INSERT INTO `articles` VALUES (3,'АШУҮИС, ТҮРК УЛСЫН КЯТИБА ЧЕЛЕБИ ИХ СУРГУУЛЬТАЙ ХАМТРАН АЖИЛЛАХААР БОЛЛОО','Кятиба Челеби их сургуулийн ерөнхийлөгч профессор Саффет Косе, дэд захирал профессор Туран Гүкче, профессор Шабан Доган нарын  АШУҮИС-д  хийсэн айлчлал амжилттай болж өнгөрлөө. Тус айлчлалын хүрээнд Монгол Улсын Анагаахын Шинжлэх Ухааны Үндэсний Их Сургууль ба Түрк улсын  Кятиба Челеби их сургуулийн хооронд 2019-2023 онд хамтын ажиллагааны санамж бичгийг үзэглэв.\n    Уг санамж бичигт хоёр их сургуулийн хооронд оюутан солилцоо, хамтарсан судалгаа, багш, оюутнууд болон залуу ажилчдыг сургах чиглэлээр туршлага солилцох үйл ажиллагаа, олон улсын эрдэм шинжилгээний бага хурал, семинар зохион байгуулах зэргээр хамтран ажиллахаар тусгажээ.\n',NULL,'2019-08-08 01:02:11','2019-09-03 23:32:57'),(4,'БАС-ИЙН ОЮУТНУУД ЯПОН УЛСАД ХҮНИЙ ИХ ЭМЧ МЭРГЭЖЛЭЭР СУРАЛЦАХААР БОЛЛОО','АШУҮИС болон Япон улсын Олон Улсын Эрүүл Мэнд, Нийгмийн Хамгааллын Их Сургуулийн хамтын ажиллагааны хүрээнд Био-Анагаахын сургуулийн оюутан Б.Түмэнхишиг, М.Янжинлхам нар Япон улсад хүний их эмч мэргэжлээр суралцахаар боллоо. АШУҮИС-ийн захирал Ж.Цолмон 2019 оны 07 сарын 03-ны өдөр шалгарсан оюутнуудыг хүлээн авч уулзаж, амжилт хүссэн.  Япон улсын Олон Улсын Эрүүл Мэнд, Нийгмийн Хамгааллын Их Сургуулийн бакалаврын тэтгэлэгт нийт арван оюутан шалгаруулалтад оролцсоноос ийнхүү хоёр оюутан шалгарч явахаар болоод байна.\n     Мөн хамтын ажиллагааны хүрээнд Япон улсын Олон Улсын Эрүүл Мэнд, Нийгмийн Хамгааллын Их Сургуульд АШУҮИС-ийн нийт 7 оюутан бакалаврын тэтгэлэгт тэнцэн хүний их эмч мэргэжлээр суралцаж,  АШУҮИС-ийн 4 багш тус их сургуульд ажиллаж байгаа юм.\n',NULL,'2019-08-08 01:06:10','2019-09-03 23:33:08'),(5,'Монголын Дүрс Оношилгооны Эмч Нарын Үндэсний Чуулган-2019 зохион байгуулагдана','“МОНГОЛЫН ДҮРС ОНОШИЛГООНЫ ЭМЧ НАРЫН ҮНДЭСНИЙ ЧУУЛГАН”  нь дэлхийн өнцөг булан бүрт буй мэргэжил нэгт эмч нартай харилцан туршлага мэдлэгээ хуваалцах завшаан бөгөөд нийгэмлэгийн маань эрхэм зорилго билээ.\nЭнэхүү зорилгоо биелүүлэхийн тулд энэ удаагийн чуулганаа “Мэнд.мн аппликэйшн болон “Хэйлт Маркетинг Сервисэс” ХХК -уудтай хамтран “Digital Transformation” буюу “Дижитал шилжилт” нэртэйгээр техник, технологийн дэвшлийг ашиглаж мэргэжлийн өндөр төвшинд бүрэн дижиталжсан, цаасгүй хурал хэлбэрээр зохион байгуулж эрүүл мэндийн салбарт хурал зохион байгуулалтын  цоо шинэ соёлыг бий болгохоор төлөвлөн ажиллаж байгаагаараа онцлог юм.\nМөн энэ удаагийн хуралд Монголын дүрс оношилгооны шилдэг эмч, судлаачдын илтгэлүүдийг хэлэлцүүлэхээс гадна урилгаар Япон, Солонгос, Хятад, Тайван зэрэг олон улсын  профессорууд болох эмч, багш, судлаачид оролцоно.\nШинэ нээлт, шилдэг бүтээл, шинэ технологиор дамжуулан салбарынхаа судалгааны чанарыг сайжруулж шинэ төвшинд аваачсан хурал болно гэдэгт бүрэн итгэлтэй байна.\n',NULL,'2019-08-08 01:08:09','2019-09-03 23:33:19'),(6,'Doctor Weighs In','Starting as a blog that discusses obesity and weight loss, The Doctor Weighs In has expanded to be a valuable resource on all things healthcare—covering medicine, psychology, neurobiology, exercise, fitness and health tech. The Doctor Weighs In aims to lead in terms of providing reliable, high quality content to anyone who seeks cutting-edge information about health and innovation.',NULL,'2019-08-08 01:09:14','2019-08-08 01:09:14'),(7,'Get Better Health','Better Health prides itself on providing “smart health commentary.” With the site’s wide array of informative articles, videos, and audio files about healthcare services, Better Health is a useful tool to guide both patients and medical professionals in the field. Aside from news articles about the latest healthcare trends, readers can also expect professional opinion and health tips from the pros themselves.',NULL,'2019-08-08 01:10:32','2019-08-08 01:10:32'),(8,'Fit Foodie Finds','Fit Foodie Finds is a wellness blog tailor-made for serial Instagram scrollers. The gorgeous photos of healthy meals are just as exciting as making them. Who knew oats could look so pretty? Healthy living posts primarily focus on recipes, but they also include workouts (booty, legs, you name it), DIY beauty, mental health, and relationships. Style-conscious readers will love it, too, with its gallery after gallery of fashion articles.',NULL,'2019-08-08 01:14:31','2019-08-08 01:14:31'),(9,'Bites of Wellness','Diet-conscious individuals who love a good cheat day will enjoy this blog that shows you how it’s done, with easy 10-minute healthy recipes and some indulgences, like sweet potato donuts. The content is geared toward carb- and fat-burning food choices, along with life tips to keep the metabolism going, like “you need sleep to lose weight.” Many recipes are available in e-book format.',NULL,'2019-08-08 01:17:16','2019-08-08 01:17:16'),(10,'To Your Health','The Washington Post’s health blog takes a very news-focused approach, covering new studies, diseases impacting the country and world, and some stories with a bit of shock factor. It’s a great resource for following up on the stories that often get just 20 seconds of coverage during your favorite morning news broadcasts.',NULL,'2019-08-08 01:18:17','2019-08-08 01:18:17'),(11,'The Medical Futurist','Don’t let the silly name fool you, because The Medical Futurist is one of the best online resources for learning about technology in the medical sphere. There’s a real sense of skepticism in each post from medical doctor and geneticist Bertalan Mesko, and the approach is refreshing.',NULL,'2019-08-08 01:20:11','2019-08-08 01:20:11'),(12,'Health IT Buzz','Health information technology might sound like a pretty specific topic, but Health IT Buzz proves how much there is to consider. Transitioning to electronic health records has led to a lot of curiosity from physicians, organizations and patients alike, so the blog’s commitment to answering questions in the comments section is especially appreciated.',NULL,'2019-08-08 01:21:07','2019-08-08 01:21:07'),(13,'Health Affairs blog','Most major news publications share what’s happening in health policy without going into much detail. This is where the Health Affairs Blog stands apart from the rest, offering analysis on issues affecting health care. They also welcome submissions, so feel free to chime in and pen a piece yourself.',NULL,'2019-08-08 01:22:37','2019-08-08 01:22:37'),(14,'Howard Hughes Medical Institute News','The Howard Hughes Medical Institute supports research efforts in cell biology, genetics, immunology, neuroscience and structural biology. Published studies are highlighted on the news blog and presented in a way that’s easy to digest.',NULL,'2019-08-08 01:25:10','2019-08-08 01:25:10'),(15,'On Medicine','BioMed Central publishes a number of blogs, but On Medicine is the place to go for those interested specifically in medical research. In addition to straight study coverage, this blog also delves into quality control issues that sometimes occur in medical research and points out important ethical considerations.',NULL,'2019-08-08 01:26:08','2019-08-08 01:26:08');
