INSERT INTO `eventfaqs` VALUES (6,'Хурал хэзээ, хаана  болох вэ?','2019 оны 9 дүгээр сарын 07, 08нд Чингис Хаан Зочид буудалд болно ',NULL,214,NULL,'2019-09-06 04:50:57','2019-09-06 04:50:57'),(8,'Уулзалтын танилцуулга ?','Монголын нөхөн сэргээх гоо сайхны мэс засалчдын нийгэмлэгийн Гутгаар чуулганыг “Мэнд.мн” аппликэйшн болон “Хэйлт Маркетинг Сервисэс” ХХК -уудтай хамтран мэргэжлийн өндөр төвшинд зохион байгуулах гэж байна.  Гоо сайхны мэс засал нь Монгол улсад харьцангуй шинэ салбар бөгөөд шинэ технологи, шинэ арга барил, шинэ эмчилгээний арга өдрөөс өдөрт нээгдэн хурдацтай хөгжиж буй салбар билээ.   Энэхүү уулзалт нь Гоо сайхны мэс заслын салбар дахь цоо шинэ нээлт, бүтээлүүдийн танилцуулга бүхий таны мэдлэгийн цар хүрээг нээж өгсөн үр дүнтэй сургалт болно гэдэгт бид эргэлзэхгүй байна.   Энэ удаагийн хурал дээр Хятад, Тайван, Солонгос, Вьетнам, Португали, Сингапур, Таиландын профессорууд хүрэлцэн ирж илтгэл хэлэлцүүлэх бөгөөд та бүхний танилын хүрээгээ мэдлэгийн хүрээтэйгээ хамт нэмэгдүүлэх бас нэгэн боломж гэж бид үзэж байна.',NULL,214,NULL,'2019-09-06 04:56:08','2019-09-06 04:56:08'),(9,'Хэрхэн бүртгүүлэх вэ ?','Та МОНГОЛЫН ДҮРС ОНОШИЛГООНЫ ЭМЧ НАРЫН ҮНДЭСНИЙ ЧУУЛГАНд оролцохыг хүсвэл хурлын хураамжийг төлснөөр төлбөр баталгаажина. \nТа төлбөр төлөхдөө өөрийн овог нэр болон дүрс оношилгооны эмчийн дугаар, утасны дугаараа заавал бичнэ үү. МэндМН аппликэйшнийг татсан бол Таны хөтөч-Төлбөр төлөх заавар цэсэнд байрлах  6 оронтой хувийн дугаарыг гүйлгээний утга дээрээ заавал бичнэ үү. \nТөлбөр төлөлт баталгаажсан тохиолдолд ажлын цагуудад таны гар утасруу мессежээр мэдэгдэх болно. Тухайн өдөр ажлын цаг дууссан бол маргааш өдөр нь төлбөр төлсөн дарааллын дагуу баталгаажуулалт хийгдэн танд баталгаажилтын Мессеж очих болно. ',NULL,215,NULL,'2019-09-08 19:22:28','2019-09-08 19:22:28'),(10,'Хэзээ бүртгэл нээгдэх вэ ?','2019.08.15 ны өдөр 00:01 минут',NULL,215,NULL,'2019-09-08 19:22:50','2019-09-08 19:22:50'),(11,'Заавал Дүрс Оношилгооны эмч байх шаардлагатай юу ?','Үгүй. Хуралд оролцохыг хүссэн эрүүл мэндийн ажилтан хүн бүр оролцох боломжтой. ',NULL,215,NULL,'2019-09-08 19:23:08','2019-09-08 19:23:08'),(12,'Хуралд оролцогчид хязгаартай юу ?','Хязгаартай. Түрүүлж бүртгүүлсэн 400 хүн оролцох боломжтой.  ',NULL,215,NULL,'2019-09-08 19:23:27','2019-09-08 19:23:27'),(13,'Төлбөр хэд вэ ?','Бүртгэлийн хураамж: Дүрс оношилгооны эмч 100 000 ₮, техникч 80000 ₮, резидент 50.000 ₮\nТөлбөр төлсөн хугацаанаас хамааран хөнгөлөлт эдлэх боломжтой.\nДемо тасалбар: 2019.08.25-ний өдрөөс өмнө 30% хөнгөлөлттэй үнээр буюу \nДүрс оношилгооны эмч 70 000 ₮, техникч 56 000 ₮, резидент 35.000 ₮\nПрототайп тасалбар: 2019.08.25- 2019.09.01-ний хооронд 20% хөнгөлөлттэй үнээр буюу\nДүрс оношилгооны эмч 80 000 ₮, техникч 64 000 ₮, резидент 40.000 ₮\nАльфа тасалбар: 2019.09.01- 2019.09.07-ний хооронд 10% хөнгөлттэй үнээр \nДүрс оношилгооны эмч 90 000 ₮, техникч 72 000 ₮, резидент 45.000 ₮\nБетта тасалбар: 2019.09.07-2019.09.12 хүртэл бүртгүүлвэл хөнгөлөлтгүй үндсэн  үнээр бүртгүүлэх боломжтой.',NULL,215,NULL,'2019-09-08 19:23:44','2019-09-08 19:23:44'),(14,'Төлбөр төлөх данс хэд вэ ?','Төлбөр төлөх данс: Хаан банк: 5037690256  \nДанс эзэмшигчийн нэр: Б.Хадаан\nТа төлбөр төлөхдөө: Овгийн эхний үсэг Нэр, Утасны дугаараа заавал бичнэ үү. \nЖишээ нь: Б.Бат 88888888',NULL,215,NULL,'2019-09-08 19:24:03','2019-09-08 19:24:03'),(15,'Төлбөрт юу багтах вэ ?','Хурлын бүртгэлийн хураамжд 2 кредит, өдрийн 2 хоол, оройн банкет, 4 удаа кофё цай орно',NULL,215,NULL,'2019-09-08 19:24:19','2019-09-08 19:24:19'),(16,'Хамт зoчин авч ирж болох уу ?','Болохгүй. Бүртгүүлсэн хүн бүрт өөрийн QR код өгөх бөгөөд зөвхөн үүгээр нэвтрэнэ. ',NULL,215,NULL,'2019-09-08 19:24:37','2019-09-08 19:24:37'),(17,'Хурал хаана болох вэ ?','Чингис Хаан Зочид Буудлын  Хурлын танхимууд',NULL,215,NULL,'2019-09-08 19:24:52','2019-09-08 19:24:52'),(18,'Бүртгэлээ цуцлах бол яах вэ ?','Хурал болохоос 3 хоногийн өмнө цуцлах хүсэлт өгвөл 10% хураамжтайгаар таны бүртгэлийг цуцалж өгнө. Үүнээс хойш цуцлах боломжгүй',NULL,215,NULL,'2019-09-08 19:25:13','2019-09-08 19:25:13'),(19,'Энэ хурал кредиттэй юу ?','Байгаа. Сургалтанд хамрагдсан эмч, мэргэжилтнүүдэд 2 кредит олгоно. ',NULL,215,NULL,'2019-09-08 19:25:30','2019-09-08 19:25:30'),(20,'Гэрээсээ онлайнаар оролцох боломжтой юу ?','Бид хуралд бүртгүүлсэн хүмүүсийг хурлын ирцээр нь үнэлж кредит олгох учир боломжгүй. ',NULL,215,NULL,'2019-09-08 19:25:46','2019-09-08 19:25:46'),(21,'Туршилт ФАК','Туршилт ФАк',NULL,226,NULL,'2020-09-28 21:22:09','2020-09-28 21:22:09'),(22,'Хаана явагдах вэ туршилт асуулт','Төрийн тусгай албан хаагчдын нэгдсэн эмнэлэг',1,227,NULL,'2020-10-11 21:55:59','2020-10-11 21:55:59'),(23,'ХЭТ АВИАН ОНОШИЛГООНЫ ОЛОН УЛСЫН  УДИРДАМЖ ТАНИЛЦУУЛАХ СУРГАЛТ  төлбөр хэд вэ?','Сургалтын төлбөр: 150000 төг',1,229,NULL,'2020-10-30 22:17:07','2020-10-30 22:17:07'),(24,'Төлбөрийг ямар дансанд хийх вэ','Данс: Хаан банк 5431212657',2,229,NULL,'2020-10-30 22:17:27','2020-10-30 22:17:27'),(25,'Дэлгэрэнгүй мэдээлэл хаанаас авах вэ?','Холбоо барих утас: 95129506\n',3,229,NULL,'2020-10-30 22:17:47','2020-10-30 22:17:47'),(26,'Хүний тоо хязгаартай юу?','Хүний тоо хязгаартай',4,229,NULL,'2020-10-30 22:18:01','2020-10-30 22:18:01');
