INSERT INTO `eventparticipants` VALUES (13,'“Хэйлт Маркетинг Сервисэс” ХХК',NULL,'Marketing Consultant Services include:\nWebsite development\nSite-to-site physician referral requests\nAdvertising (flyers, brochures, media, etc.)\nProject management\nMendmn application is a comprehensive tool for listing all the medical symposium, conferences and workshops for healthcare professionals in Mongolia. \n\nIt is a free application that enables healthcare workers to easily search for medical events relevant to their interests and specialization and network with other physicians, globally promote medical speakers and get updates on the latest advancements in medicine. \n\nIt provides all the necessary details about the event including its location, registration guide, number of CME hours, contact details and the poster of the event. It has also a link for registration based on the organizer request.\n\nWebsite: http://www.mend.mn\n',NULL,'General Organizer','2019-08-15 19:17:06','2019-09-05 20:03:00',NULL,'Ерөнхий зохион байгуулагч','Ерөнхий зохион байгуулагч'),(14,'\"МэндМН\" Аппликэйшн',NULL,'Таны Эрүүл Мэндийн Ухаалаг Туслах',NULL,'Co-organizer','2019-08-15 19:32:27','2019-09-06 07:58:44',214,NULL,'Зохион байгуулагч'),(19,'“Хэйлт Маркетинг Сервисэс” ХХК',NULL,'Health Marketing Society LLC',NULL,'General Organizer','2019-08-15 19:38:21','2019-08-21 21:05:01',217,'Ерөнхий зохион байгуулагч','Ерөнхий зохион байгуулагч'),(20,'\"Мэнд.мн\" Аппликэйшн',NULL,'Эрүүл мэнлийн ухаалаг туслах',NULL,'Organizer','2019-08-15 19:38:44','2019-08-21 21:05:25',217,NULL,'Зохион байгуулагч'),(21,'АндуудЛаб ХХК',NULL,'Anduud Lab LLC, AI & Blockchain Technology',NULL,'Organizer','2019-08-15 19:39:09','2019-08-21 21:06:25',217,NULL,'Зохион байгуулагч'),(22,'Чатбот.мн',NULL,'Customer Service AI Bot Platform',NULL,'Organizer','2019-08-15 19:39:26','2019-08-21 21:08:18',217,NULL,'Зохион байгуулагч'),(23,'MSPRS',NULL,'Mongolian Society of Plastic and Reconstructive Surgeons',NULL,'General organizer','2019-08-20 18:41:39','2019-09-06 07:58:02',214,NULL,'Ерөнхий зохион байгуулагч'),(24,'Tugs Yalguun',NULL,'Hospital',NULL,'Platinum Sponsor','2019-08-20 18:45:41','2019-09-06 08:01:21',214,NULL,'Алтан ивээн тэтгэгч'),(25,'Tod Gangnam',NULL,'Hospital',NULL,'Silver sponsor','2019-08-20 18:50:38','2019-09-06 08:04:00',214,NULL,'Хүрэл ивээн тэтгэгч'),(26,'City Medlux',NULL,'/Эм ханган нийлүүлэх байгууллага/',NULL,'Silver Sponsor','2019-08-20 18:55:48','2019-11-07 05:32:55',214,NULL,'Хүрэл ивээн тэтгэгч'),(27,'Med Mongol',NULL,'LLC, /Эм, эмнэлгийн хэрэгсэл, тоног төхөөрөмж, урвалж оношлуур/',NULL,'Platinum Sponsor\n','2019-08-20 19:04:07','2019-09-06 08:00:21',214,NULL,'Алтан ивээн тэтгэгч'),(28,'Nandingoo',NULL,'Hospital',NULL,'Platinum Sponsor','2019-08-20 19:04:59','2019-09-06 08:01:06',214,NULL,'Алтан ивээн тэтгэгч'),(39,'Perfect Clinic ',NULL,'Perfect Clinic ',NULL,'Platinum Sponsor','2019-09-05 19:59:47','2019-09-06 08:00:44',214,NULL,'Алтан ивээн тэтгэгч'),(40,'Princess Aesthetic Surgery Clinic',NULL,'Princess Aesthetic Surgery Clinic',NULL,'Silver Sponsor','2019-09-05 20:01:59','2019-09-06 08:02:46',214,NULL,'Хүрэл ивээн тэтгэгч'),(41,'Mentor J&J Medical Devices',NULL,'Mentor J&J Medical Devices',NULL,'Silver Sponsor','2019-09-05 22:18:20','2019-09-06 08:04:48',214,NULL,'Хүрэл ивээн тэтгэгч'),(42,'Shinjyuku Medical Equipment',NULL,'Бидний тухай\nШинжьюкү ХХК 2011 онд Япон Улсын JICA-н төсөл хэрэгжүүлэгч компаниар үйл ажиллагаа эхлүүлэн байгуулагдана ажиллаж ирсэн.\nМанай компани 2015 оноос эхлэн дэлхийн бренд Mindray компанитай хамтран ажиллаж, 2018 онд тус компанийн Монгол дахь албан ёсны онцгой эрхтэй дистрибютерээр ажиллаж байгаа.	\n 	Бид чанартай бүтээгдэхүүн үйлдвэрлэгчээс хамгийн хямдаар төлбөрийн уян хатан нөхцөлтэйгөөр танд хүргэхээс гадна, баталгаат хугацаа, мэргэжлийн засвар үйлчилгээ, сургалт зэргээр хангана.\n 	Манай оффис Улаанбаатар хотын Хан-Уул дүүргийн 1-р хороонд байрлах Их-Хуралдай оффисын 1107 тоотод байрлах ба оффисын утас 77131133.\n 	\nХАМТДАА ХӨГЖЬЕ ШИНЖЬЮКҮ ХХК\n\nФэйсбүүк хуудас: https://www.facebook.com/mongoliamindray/\n',NULL,'Terra Sponsor','2019-09-08 18:43:37','2019-09-11 20:51:39',215,NULL,'Алтан ивээн тэтгэгч'),(43,'МэндМН',NULL,'“Мэнд эм эн эм” ХХК нь гадаад болон дотоодод олон жил мэдээлэл технологийн чиглэлээр ажилласан туршлагатай залуучуудаас бүрдсэн технологийн баг, нөгөө талаас эмнэлгийн салбартаа манлайлагч эмнэлгийн мэргэжилтнүүдийн нэгдсэн мэргэшсэн мэргэжилтнүүдийн баг бөгөөд хиймэл оюун, блокчэйн технологид суурилсан МэндМН хэмээх ухаалаг эрүүл мэндийн туслах болон эрүүл мэндийн мэргэжилтнүүдийн нэгдсэн сүлжээг Монгол улсдаа амжилттай нэвтрүүлэхээр хичээнгүйлэн ажиллаж байна. Бидний анхны бүтээгдэхүүн болох Мэндмн аппликэйшний “Мэнд эвэнт” маань амжилттай хийгдсэн бөгөөд өнөөдрийн байдлаар “Монголын Нөхөн Сэргээх Гоо Сайхны Мэс Засалчдын Холбооны  олон улсын гуравдугаар уулзалт”, “Монголын Дүрс Оношилгооны Эмч Нарын Үндэсний Чуулган-2019” “Монголын Өрхийн Эмнэлгүүдийн үүсч хөгжсөний 20 жилийн ой ” зэрэг уулзалт хурлуудыг дижитал хэлбэрээр тус тус зохион байгуулахаар ажиллаж байна.\nВэбсайт: https://mend.mn/\n',NULL,'Terra Sponsor','2019-09-08 18:47:35','2019-09-09 19:51:44',215,NULL,'Алтан ивээн тэтгэгч'),(45,'Bayer',NULL,'БАЙЕР – радиологийн салбарт дэлхийд тэргүүлэгч компани бөгөөд тодосгогч бодис болон PET, СҮТ, KT, ангиографид зориулагдсан MEDRAD ® автомат тарилгын систем үйлдвэрлэгч төдийгүй  радиологийн салбарыг хөгжүүлэгч гэдгээр дэлхийд хүлээн зөвшөөрөгдсөн компани.\r\n\r\n#303, Office center «Azmon»\r\nEnkhtaivan avenue – 50,\r\ndist. Sukhe-Bator, 1 khoroo,\r\n17000  Ulaanbaatar,\r\nMongolia\r\nMob:      +976 99098457\r\nE-mail:  erdenetulga.pagd.ext@bayer.com',NULL,'Mega Sponsor','2019-09-08 18:49:55','2019-10-10 01:06:11',215,NULL,'Хүрэл ивээн тэтгэгч'),(46,'Arima Medical',NULL,'Arima Medical нь 100% Монгол улсын хөрөнгө оруулалттай бөгөөд 2012 оны 09 сарын 13нд байгуулагдсан. \nОдоогоор Hitachi-Medical corporation, Koike medical, Nidek, Udono, Hirayama , Nagashima, Fuji-elite, Fujifilm /Япон  /, Shinva, Perlove /Хятад /, болон бусад эмнэлгийн тоног төхөөрөмж үйлдвэрлэгч бүх компаниудтай холбоотой хамтран ажиллаж байна.	\n\nҮйл ажиллагааны чиглэл\n- Эмнэлгийн тоног төхөөрөмж ханган нийлүүлэх\n- Эмнэлгийн тоног төхөөрөмж угсралт суурилуулалт\n- Эмнэлгийн тоног төхөөрөмжийн баталгаат хугацааны засвар үйлчилгээ\n- Эмнэлгийн тоног төхөөрөмжтэй холбоотой сургалт, зөвлөгөө\n- Гадаад худалдаа\nМонгол улсад суурилуулсан эмнэлгийн тоног төхөөрөмжүүд: \nMRI	- 1ш\nОлон зүсэлтийн Компьютерт Томограф - 1ш\nДижитал Рентген - 5ш\nЭХО - 40ш\nНүдний оношлогооны тоног төхөөрөмж - 20ш\nБусад тоног төхөөрөмж - 100 ш\n\nТуршлага:  Манай хамт олон Монгол улсад анхны MRI аппарат, нийт 21 дижитал рентген аппарат суурилуулж , рентген өрөөний хамгаалалтыг хийж гүйцэтгэж байсан туршлагатай. Одоогийн байдлаар Эрдэнэт хотын шинэ оношлогооны төвийг  Япон улсын эмнэлгийн тоног төхөөрөмжөөр хангаж  суурилуулах ажлыг хийж гүйцэтгэж дуусаад  байна.  \nХаяг: Баянгол  дүүрэг, 3-р хороо, энгельсийн гудамж 43 тоот\nУтас: 70101098,  99020483,  99046220	\nВэбсайт: http://arima-medical.mn/mn/\n\n',NULL,'Mega Sponsor','2019-09-08 18:54:29','2019-09-10 00:05:25',215,NULL,'Хүрэл ивээн тэтгэгч'),(47,'Monsun Medical Service',NULL,'“Монсан Медикал сервис” ХХК нь 2014 онд байгуулагдсан ба оношилгоо эмчилгээний орчин үеийн дэвшилтэт технологи бүхий тоног төхөөрөмжийн худалдаа, туслах сэлбэг хэрэгсэл болон сүүлийн үеийн дэвшилтэд технологийн дагуу ариутгасан эмнэлгийн нэг удаагийн хэрэгсэл ханган нийлүүлэх бүхий цогц үйлчилгээг хэрэглэгчдэд хүргэдэг.   \nҮйл  ажиллагааны үндсэн чиглэл: \nЭмнэлгийн тоног төхөөрөмжийн худалдаа, угсралт суурилуулалт, засвар үйлчилгээ\nЭмнэлгийн нэг удаагийн хэрэгслийн ханган нийлүүлэлт\n\nБидэнтэй холбоо барих \nХаяг: Улаанбаатар хот, БГД 7-р хороо, Ард Аюушийн гудамж 90/63 \nУтас:  +97677024075\nИ-мэйл: info@monsun.mn\nВеб хаяг: https://monsun.mn/',NULL,'Mega Sponsor','2019-09-08 18:55:27','2019-09-10 00:06:15',215,NULL,'Хүрэл ивээн тэтгэгч'),(48,'Brilliant Hospice ',NULL,'“Бриллиант Хоспис” магадлан итгэмжлэгдсэн эмнэлэг нь Улаанбаатар хотын Баянзүрх дүүрэг, 13-р хороолол Намянжугын гудамжны 20/3 тоот байрладаг.  Нийтдээ 800 гаруй м2 талбайд эрүүл мэндийн тусламж үйлчилгээ үзүүлэх зорилгоор дотоодын  хөрөнгө оруулалтаар  үүсгэн байгуулсан юм.  “Бриллиант Хоспис” эмнэлэг нь улсын хэмжээнд хөнгөвчлөх тусламж үйлчилгээний цогц байгууллага болох 10 ор бүхий ХОСПИС, орчин үеийн дэвшилтэт технологи, тоног төхөөрөмжөөр тоноглогдсон  Дүрс оношлогооны хэсэг ( компьютерт томографи, хэт авиан оношилгоо)  Клиник биохимийн лаборатори зэрэг цогц үйл ажиллагааг эрхлэнэ. \n\nФэйсбүүк хуудас: https://www.facebook.com/brilliantclinicmongolia/',NULL,'Mega Sponsor','2019-09-08 18:56:20','2019-09-10 06:07:54',215,NULL,'Хүрэл ивээн тэтгэгч'),(49,'Med Trauma Hospital ',NULL,'Манай эмнэлэг  нь 2013 онд байгуулагдсан бөгөөд улсын хэмжээнд Гэмтэл, согогийн тусламж үйлчилгээ үзүүлэх амбулaтори болон мэс заслын хэвтэн эмчлүүлэх 15 ортой тасаг, Орчин үеийн дэвшилтэт тоног төхөөрөмж болох Соронзон үелзүүрт томографи-MRI, Компьютерт томографи-СТ, Дижитал рентген, зэрэг Дүрс оношилгооны тусламж үйлчилгээг 24 цагийн турш чанартай, найдвартай үзүүлж байна. \n\nХаяг: Баянгол дүүрэг 7-р хороо, Ард Аюушийн гудамж 90/6-р байр\n\nХолбоо Барих: 77110351, 77110352\nВэбсайт: http://medtrauma.mn/\n',NULL,'Mega Sponsor','2019-09-08 18:57:21','2019-11-07 01:25:38',215,NULL,'Хүрэл ивээн тэтгэгч'),(50,'CIT',NULL,'Си-Ай-Ти ХХК нь 2004 оноос эхлэн эмнэлгийн багаж хэрэгсэл, тоног төхөөрөмжийн импорт, нийлүүлэлт, угсралт, засвар үйлчилгээний мэргэжлийн байгууллагын үйл ажиллагааг явуулж байна.\nӨнөөг хүртэл бидэнтэй хамтран ажиллаж ирсэн эрүүл мэндийн салбарын бүх эмч, ажилтан, сувилагч, техникчид, энэ салбараар үйлчлүүлж байгаа хүндэт хэрэглэгч нартаа чин сэтгэлийн талархал илэрхийлье.\n\nБидний үнэт зүйл: \n-  Зөв үйл ажиллагаа \n-  Найдвартай, шуурхай угсралт, засвар үйлчилгээ  \n-  Үйлдвэрлэгч компаниуд дээр сургагдсан, албан ёсны сертификаттай, мэрг