-11 20:51:00',215,NULL,'Алтан ивээн тэтгэгч'),(60,'Эрүүл мэндийн яам',NULL,'Эрүүл мэндийн яам',NULL,'General Organizer','2019-09-08 19:14:29','2019-09-11 04:43:34',215,NULL,'Ерөнхий зохион байгуулагч'),(61,'Mongolian Society of Radiology',NULL,'        “МОНГОЛЫН ДҮРС ОНОШИЛГООНЫ ЭМЧ НАРЫН ҮНДЭСНИЙ ЧУУЛГАН-2019”  нь дэлхийн өнцөг булан бүрт буй мэргэжил нэгт эмч нартай харилцан туршлага мэдлэгээ хуваалцах завшаан бөгөөд нийгэмлэгийн маань эрхэм зорилго билээ. \n\n        Бид энэхүү зорилгоо биелүүлэхийн тулд энэ удаагийн чуулганаа “Мэнд.мн аппликэйшн болон “Хэйлт Маркетинг Сервисэс” ХХК -уудтай хамтран “Digital Transformation” буюу “Дижитал шилжилт” нэртэйгээр техник, технологийн дэвшлийг ашиглаж мэргэжлийн өндөр төвшинд бүрэн дижиталжсан, цаасгүй хурал хэлбэрээр зохион байгуулж эрүүл мэндийн салбарт хурал зохион байгуулалтын  цоо шинэ соёлыг бий болгохоор төлөвлөн ажиллаж байгаагаараа онцлог юм. Мөн энэ удаагийн хуралд Монголын дүрс оношилгооны шилдэг эмч, судлаачдын илтгэлүүдийг хэлэлцүүлэхээс гадна урилгаар Япон, Солонгос, Хятад, Тайван зэрэг олон улсын  профессорууд болох эмч, багш, судлаачид оролцоно. \nЭнэ удаагийн хурлаар бид шинэ нээлт, шилдэг бүтээл, шинэ технологиор дамжуулан салбарынхаа судалгааны чанарыг сайжруулж шинэ төвшинд зохион байгуулах болно гэдэгтээ бүрэн итгэлтэй байна.\n\nФэйсбүүк хуудас: https://www.facebook.com/MongolianRadiology/\n\n',NULL,'General Organizer','2019-09-08 19:15:05','2019-09-11 20:11:30',215,NULL,'Ерөнхий зохион байгуулагч'),(62,'Mend Event',NULL,'Mend Event\nМонголын Эрүүл Мэндийн Салбарт зохион байгуулагдаж буй бүх  хурал, чуулган, сургалтуудын мэдээлэл, оролцох бүртгүүлэх боломж. \n\nFb хуудас: https://www.facebook.com/Mend-Event-105402410820795/',NULL,'General Organizer','2019-09-11 03:51:18','2019-09-11 03:51:18',215,NULL,'Ерөнхий зохион байгуулагч'),(63,'Sammit Medical Service LLC',NULL,'“Саммит Медикал Сервис” ХХК нь 2011 онд байгуулагдсан бөгөөд эрүүл мэндийн\r\nүйлчилгээ эрхэлдэг байгууллагуудад эм, эмнэлгийн хэрэгсэл, тоног төхөөрөмж ханган\r\nнийлүүлэлдэг компани юм.\r\n\r\nМанай компаний эрхэм зорилго:\r\nДэлхийн брэнд болсон чанарын баталгаа, аюулгүй ажиллагааны шаардлага хангасан өндөр\r\nтехнологи бүхий эмнэлгийн тоног төхөөрөмж, эм, эмнэлгийн хэрэгслээр Монгол улсын эрүүл\r\nмэндийн байгууллагуудыг хангаж, хүн амд үзүүлэх эрүүл мэндийн оношлогооны тусламжийг\r\nшинэ шатанд гаргах юм.\r\n\r\nБүтээгдэхүүн: \r\n- Эм\r\n- Эмнэлгийн хэрэгсэл\r\n- Эмнэлгийн тоног төхөөрөмж\r\n- Тоног төхөөрөмжийн засвар, үйлчилгээ\r\n Вэбсайт: https://www.facebook.com/SummitMedicalService/',NULL,'Kilo Sponsor ','2019-09-11 04:34:57','2019-11-07 05:50:21',215,NULL,'Ивээн тэтгэгч'),(64,'Талын Хишиг Майнинг ',NULL,'“Талын хишиг майнинг” ХХК 2017 онд үүсгэн байгуулагдсанаас хойш уул уурхайн бүтээгдэхүүнийг экспортлох, тээвэрлэх үйл ажиллагаа явуулж байна. Бид өөрийн эзэмшлийн 500 вагоноор төмрийн хүдэр, нүүрс зэрэг уул уурхайн бүтээгдэхүүн тээвэрлэдэг.   \r\n\r\nМанай компани дотоодын нэр хүндтэй томоохон байгууллагууд болох Монгол, Оросын хувь нийлүүлсэн Улаанбаатар төмөр зам нийгэмлэг, “Монголын төмөр зам” Төрийн өмчит хувьцаат компани, Болдтөмөр Ерөө гол ХХК, Дарханы төмөрлөгийн үйлдвэр ХК, Могойн гол ХК, Штанколе ХХК, Чингисийн хар алт ХХК, Алаг тогоо ХХК, Энержи эко транс ХХК, БНХАУ-ын Эрээн хотын Жиншиншень импорт, экспортын худалдааны компани, Эрээн хотын Жинменлиан компани, Жөшань Жунта групп ХХК зэрэг гадны байгууллагуудтай хамтран ажилладаг. \r\n\r\nБайгууллагын зүгээс ажлын байрыг байнга нэмэгдүүлэх бодлого баримталдаг бөгөөд одоогоор манай ажилчдын 90%-ийг 23-38 насны залуус эзэлж байна. Цаашид залуу боловсон хүчнийг бэлтгэж мэргэшүүлэн салбартаа өсөлттэй, манлайлагч байгууллага болох зорилт тавин ажиллаж байна.\r\n',NULL,'Kilo Sponsor ','2019-09-11 04:42:16','2019-09-11 19:21:13',215,NULL,'Ивээн тэтгэгч'),(65,'Монос Хүнс ХХК',NULL,'Монос Хүнс ХК нь 2012 оноос хойш ард иргэдийнхээ эрүүл мэндийг дэмжих зорилготойгоор хүнсний нэмэлт бүтээгдэхүүний үйлдвэрлэл, худалдааны чиглэлээр үйл ажиллагаагаа явуулж эхэлсэн бөгөөд өдгөө 2019 онд Монголын хөрөнгийн биржид\nбүртгэлтэй хувьцаат компани болж өргөжсөн. Бид  Монгол орны хөрсөнд ургасан, байгалийн гаралтай түүхий эдийг биологийн идэвх хамгийн өндөр үед сорчлон бэлтгэж, дэмтэн судлаачдын олон жилийн туршилт, судалгааны үр дүнд эрүүл мэндийг дэмжих 6\nбрэндийн 82 төрлийн хүнс, хүнсний нэмэлт бүтээгдэхүүнийг  үйлдвэрлэж, хэрэглэгчиддээ хүргэж байна.\n\nВэбсайт: https://www.monos.mn/mn/project/monos-foods-ipo-launch/\n\n',NULL,'Ерөнхий ивээн тэтгэгч','2019-09-15 23:54:55','2019-09-16 02:36:12',220,NULL,'Алтан ивээн тэтгэгч'),(66,'Монос Груп',NULL,'Монгол оюун сэтгэлгээг дэлхийд таниулна алсын хараатай Монос Групп нь 29 жилийн түүхтэй,\nэрүүл мэндийн бүтээгдэхүүний Үйлдвэрлэл, Үйлчилгээ, Төсөл, Экспорт Импорт гэх мэт чиглэлээр\n15 гаруй компани үйл ажиллагаа явуулж байгаа Монголын ууган хувийн хэвшлийн нэг юм. Монголын ууган эмийн үйлдвэрүүдийн нэг Монос Фарм ХХК нь 1990 онд хувийн хэвшлийн анхдагч эмийн үйлдвэр болон байгуулагдсан. Хүмүүний эрүүл мэндийг\nтэтгэх эмчилгээний өндөр идэвхт эм бэлдмэл, эмийн чанарыг хамгаас эрхэмлэн эмийн үйлдвэрлэл, эмзүйн судалгаа, шинжилгээний чиглэлээр үйл ажиллагаагаа явуулж байна.\nНийтдээ 100 гаруй эм бэлдмэлийг шахмал, капсул, нунтаг,  үрэл , тосон түрхэц, цацлага, шингэн, гален хэлбэрээр үйлдвэрлэж байгаагаас 30 гаруй нэр төрөл нь тус компанийн брэнд бүтээгдэхүүн юм. МУ-ын зайлшгүй шаардлагатай эмийн жагсаалтанд орсон 25 гаруй нэр төрлийн эмийг үйлдвэрлэдэг бөгөөд дархлаа сэргээх “ Салимон ”, шүдний тулгуур эд, буйл,\nамны салстыг эмчлэх “ Дентамон ” бэлдмэлүүд нь Монгол Улсын төрийн шагнал хүртсэн билээ.\n\nВэбсайт: http://www.monos.mn/mn/\n\n',NULL,'Ерөнхий ивээн тэтгэгч ','2019-09-16 00:19:47','2019-09-19 22:09:51',220,NULL,'Алтан ивээн тэтгэгч'),(67,'Монгол Эм Импэкс Концерн ХХК',NULL,'Анх 1923 онд “Нэгдүгээр эмийн сан” нэртэйгээр\nтулгын чулуугаа тавьж, үйл ажиллагаагаа эхэлснээс хойш Монгол улсын эмнэлэг, эрүүл мэндийн байгууллага, хүн ардыг зайлшгүй шаардлагатай чанарын баталгаатай эм, эмнэлгийн хэрэгслээр хангах нэр төртэй, нэн хариуцлагатай үүргээ 96 жилийн турш\nтасралтгүй, хариуцлагатайгаар гүйцэтгэж ирсэн үндэсний хэмжээний ууган эм хангамжийн\nкомпани юм.\nТөрийн өмчийн мэдэлд байсан тус концерн нь 2007 оноос эхлэн бүхэлдээ хувийн өмчид шилжсэнээр бид нэн тэргүүнд компанийн үйл ажиллагааг олон улсын жишигт хүргэх, зах зээлд эзэлсэн байр сууриа бэхжүүлэх тогтвортой өсөлтийн стратегийг ханган ажиллаж байна.\nХувьчлагдсанаас хойш Фарммаркет эмийн сангийн сүлжээгээрээ хэрэглэгчдэд ойртож, тэдний хэрэгцээ шаардлагад суурилсан, орчин үеийн шинэлэг үйлчилгээгээ хүргэн, тохь тухтай орчинд өргөн сонголттой, чанарын баталгаатай эм, эмийн бүтээгдэхүүнээр үйлчилж байгаа нь иргэдийн талархлыг ихэд хүлээж байна.',NULL,'Gega Sponsor','2019-09-16 00:22:39','2019-09-16 00:23:47',220,NULL,'Мөнгөн ивээн тэтгэгч'),(68,'Gedeon Richter',NULL,'Gedeon Richter',NULL,'Mega Sponsor','2019-09-16 00:26:41','2019-09-16 00:26:41',220,NULL,'Хүрэл ивээн тэтгэгч'),(69,'Монос Косметик ',NULL,'Товч танилцуулга:\nМонголын гоо сайхны үйлдвэрлэлийн анхдагч үндэсний баялаг бүтээгч Монос Косметик ХХК нь Монгол орны эрс тэс уур амьсгалаас Монгол хүний гоо сайханг төгс хамгаалах бүтээгдэхүүн үйлдвэрлэхээр зорин ажиллаж, өөрийн орны гоо сайхны үйлдвэрлэлийн өнгө төрх хөгжлийг тодорхойлсоор ирсэн. 29 жилийн түүхтэй манай компани нь өөрийн эм судлалын хүрээлэн, олон улсын мэргэжлийн судалгаа, шинжилгээний байгууллагуудтай хамтран судалгаа хөгжил, шинэлэг технологи нэвтрүүлэхэд онцгой анхаарч ирсэн бөгөөд Монгол орны хөрсөнд ургасан, байгалийн цэвэр түүхий эдээр, олон төрлийн амин хүчил эрдэс бодис биологийн идэвхит нэгдлээр баялаг органик гоо сайхны бүтээгдэхүүн үйлдвэрлэж байгаагаараа онцлог юм. Монос Косметик компанийн Биомон арьс арчилгааны цуврал, Биомон үс арчилгаа, Үрчлээний эсрэг Биоген багц нь олон улсын болоод Монголын нэр хүндтэй томоохон шагналуудын эзэн болсон. Түүнээс гадна гар арчилгаа, Санитас брэнд, хүүхдийн бие арчилгааны бүтээгдэхүүн, хонины сүүлтэй тос зэрэг нийт 80 гаруй нэр төрлийн бүтээгдэхүүнийг үйлдвэрлэн Монголынхоо хэрэглэгчиддээ\nхүргэж байна.\n\nВэбсайт: https://monoscosmetics.mn/\n\n',NULL,'Ерөнхий ивээн тэтгэгч','2019-09-16 02:20:51','2019-09-16 02:35:57',220,NULL,'Алтан ивээн тэтгэгч'),(70,'Ашид Буян ХХК ',NULL,'            Ашид Буян ХХК нь 2009 оноос эхлэн үйлдвэрийн тоног төхөөрөмжийн худалдааны чиглэлэлээр тасралтгүй үйл ажиллагаа явуулж ирсэн түүхтэй. 2010 оноос эхлэн эмнэлгийн багаж тоног төхөөрөмж,хэрэгсэл импортлох, ханган нийлүүлэх худалдах тусгай зөвшөөрлийн дагуу үйл ажиллагаагаа өргөжүүлэн төрийн ба төрийн бус байгууллагууд, олон улсын хандивлагч байгууллагууд ( НҮБ, Мянганы сорилтын сан, Дэлхийн Зөн ОУБ, Тогтвортой амьжиргаа), улсын болон хувийн өмчийн эмнэлэгүүдтэй хамтран ажиллаж хамгийн сүүлийн үеийн дэвшилтэт технологи, чанар болон эдийн засгийн өндөр үр ашиг бүхий, харьцангуй хямд үнэтэй хэрэглэгчдийн шаардлагад бүрэн нийцэх эмнэлэгийн тоног төхөөрөмжийг захиалагчийн тавьсан нөхцөлд бүрэн нийцүүлэн ханган нийлүүлж ирсэн. \n                 Манай компани 2010-2014 он хүртэл дэлхийн шилдэг дурангийн мэс заслын тоног төхөөрөмж үйлдвэрлэгч болох Герман улсын Карл Шторц компанийн албан ёсны төлөөлөгчөөр ажиллаж байсан ба Улсын болон орон нутгийн томоохон нэгдсэн эмнэлгүүдэд иж бүрэн дурангийн мэс заслын тоног төхөөрөмж нийлүүлсэн болно. Үүнээс гадна бид улсдаа хамгийн анхны лазер бөөрний чулуу бутлагч дурангийн мэс заслын иж бүрдлийг УБ-Сонгдо эмнэлэгт суурилуулсан болно. \n               Бид одоогийн байдлаар 200 гаруй нэр төрлийн энгийн гардан үйлдлийн эмнэлгийн багаж техник, нэг удаагийн багаж хэрэгслүүдээс эхлэн эмнэлгийн нарийн мэргэжлийн сүүлийн үеийн дэвшилтэт тоног төхөөрөмжүүдийг Итали, Герман, ОХУ, Япон, Солонгос, Тайвань, Сингапур, Хонконг, Хятад зэрэг улсуудаас Монгол Улсад ханган нийлүүлэх, худалдах, түүнтэй холбогдох сервис үйлчилгээ, баталгаат хугацаа, сургалт зэрэг иж бүрэн үйлчилгээг хэрэглэгчдэд үзүүлж байна\n\nМанай хаяг: Сүхбаатар дүүрэг , 8 дугаар хороо, Оюутны гудамж , “Unity”Center , 402 тоот \nУтас: 976-70002668, 88063346, 95953099 \nФакс: 976-70002668\nВэбсайт: http://ashidbuyan.khas.mn/\n\n\n',NULL,'Дэмжигч Байгууллага','2019-09-16 02:41:59','2019-09-16 02:52:05',220,NULL,'Ивээн тэтгэгч'),(71,'Ерөнхийлөгчийн Тамгын Газар',NULL,'Ерөнхийлөгчийн Тамгын Газар\n\nВэбсайт: https://president.mn/',NULL,'General Organizer','2019-09-16 02:50:37','2019-09-16 18:19:17',220,NULL,'Ерөнхий зохион байгуулагч'),(72,'Монголын Өрхийн Анагаах Ухааны Мэргэжилтнүүдийн Холбоо',NULL,'Монголын өрхийн анагаах ухааны мэргэжилтнүүдийн холбоо (МӨАУМХ) нь  Монгол улсын 21 аймаг, нийслэлийн 8 дүүрэгт салбар зөвлөлтэй, салбар зөвлөлөөр дамжуулан 220 өрхийн эрүүл мэндийн төвийн 3000 гаран эмч, ажилчдыг эгнээндээ нэгтгэсэн 20 жилийн түүхтэй салбарын хэмжээнд үйл ажиллагаа явуулдаг томоохон төрийн бус байгууллага юм.  \nМонгол улсад өрхийн анагаах ухааныг хөгжүүлэхэд тус холбоо ихээхэн үүрэг гүйцэтгэсэн бөгөөд өрхийн эмнэлгийг үүсгэн байгуулах, хөгжүүлэх, хууль эрх зүйн бодлогын бичиг баримтыг боловсруулах, хүний нөөцийг сургах, байр, тоног төхөөрөмжөөр хангах, санхүүжилтыг нэмэгдүүлэх өрхийн эмнэлгийг удирдлага зохион байгуулалтаар хангаж, мэргэжил арга зүйгээр зөвлөн, тэдний нийтлэг эрх ашгийг хамгаалан төр засагтай холбох гүүр болон ажиллаж байна. Өнөөдөр өрхийн эмч, мэргэжилтнүүдийн хамгийн дотны зөвлөх, туслагч нь болсондоо бид  баяртай байна.\nМӨАУМХ нь Дэлхийн өрхийн эмч нарын нийгэмлэг WONCA-н гишүүн байгууллага бөгөөд Дэлхийн, бүсийн хурал зөвлөгөөнд идэвхтэй оролцож байна. Бид Өрхийн анагаах ухаан сэтгүүлийг эрхлэн гаргаад 20  жил болж байна. \n',NULL,'General Organizer','2019-09-16 02:51:50','2019-09-16 02:54:20',220,NULL,'Ерөнхий зохион байгуулагч'),(73,'Эрүүл Мэндийн Яам',NULL,'Эрүүл Мэндийн Яам',NULL,'Organizer','2019-09-16 18:22:10','2019-09-16 20:46:24',220,NULL,'Зохион байгуулагч'),(74,'Нийслэлийн Эрүүл Мэндийн Газар',NULL,'Нийслэлийн Эрүүл Мэндийн Газар',NULL,'Organizer','2019-09-16 18:24:00','2019-09-16 20:46:30',220,NULL,'Зохион байгуулагч'),(75,'Азийн Хөгжлийн Банк',NULL,'Азийн Хөгжлийн Банк',NULL,'Organizer','2019-09-16 18:25:07','2019-09-16 20:46:36',220,NULL,'Зохион байгуулагч'),(76,'World Health Organization',NULL,'World Health Organization',NULL,'Organizer','2019-09-16 18:27:51','2019-09-16 20:46:42',220,NULL,'Зохион байгуулагч'),(77,'Mendmn',NULL,'Mendmn',NULL,'Organizer','2019-09-16 18:31:09','2019-09-16 20:46:49',220,NULL,'Зохион байгуулагч'),(78,'Denk Pharma',NULL,'Die DENK PHARMA GmbH & Co. KG ist ein familiengeführtes, in 80 Ländern international tätiges Unternehmen mit Sitz in München. Als deutscher Generikahersteller und Export-Spezialist vertreiben wir unsere Medikamente und Nahrungsergänzungsmittel weltweit.\n\nWir bieten weltweit jedem Patienten genau die gleiche Qualität wie sie in jeder deutschen Apotheke zu finden ist.\n\nDENK PHARMA wurde 1948 in München gegründet. Gesundheit ist für jeden Menschen kostbar, unabhängig davon, wo er lebt und welche finanziellen Mittel ihm zur Verfügung stehen. Seit mittlerweile 70 Jahren steht bei uns das Thema „Verbesserung der Lebensqualität für alle Menschen weltweit“ im Mittelpunkt. Daher setzen wir seit dem Gründungstag auf Qualität „Made in Germany“.\n\nhttp://denkpharma.mn/\n',NULL,'Дэмжигч Байгууллага','2019-09-17 18:24:32','2019-09-17 18:24:54',220,NULL,'Ивээн тэтгэгч'),(80,'Ивээлтгүн',NULL,'Эмнэлгийн тоног төхөөрөмж, эм, эмнэлгийн хэрэгсэл, урвалж бодис ханган нийлүүлэгч \nБид “ИВЭЭЛТГҮН” ХХК нь Монгол улсын эрүүл мэндийн салбарт өөрийн хувь нэмрийг оруулах зорилготойгоор байгуулагдсан дэлхийн шилдэг эрүүл мэндийн технологиудыг ханган нийлүүлэгч, зөвлөх үйлчилгээ үзүүлдэг байгууллага юм. \n\nҮйл ажиллагааны чиглэл: \n- Эмнэлгийн тоног төхөөрөмж, эм, эмнэлгийн хэрэгсэл, урвалж бодис ханган \nнийлүүлэх, худалдаалах, засвар үйлчилгээ үзүүлэх. - Эмнэлгийн тоног төхөөрөмж, эм, эмнэлгийн хэрэгсэл, урвалж бодис ханган \nнийлүүлэх чиглэлээр, төсөл, судалгаа хийх зөвлөх үйлчилгээ үзүүлэх. \n\nГадаад харилцаа: \nБид олон улсад хүлээн зөвшөөрөгдсөн томоохон үйлдвэрлэгч нартай хамтран ажилладаг ба Монгол хүний бие физиологид тохирсон орчин үеийн эмнэлгийн тоног төхөөрөмж, эмнэлгийн багаж, хэрэгслүүдийг АНУ, Япон, БНСУ, ХБНГУ, БНХАУ, ОХУ, Турк, Энэтхэг зэрэг 20 гаруй улсын тэргүүлэгч үйлдвэрлэгч нартай тогтмол хамтран ажилладаг. \nХамтран ажилладаг томоохон үйлдвэрлэгч нараас дурдвал: Takara Belmot, Terumo-Anon. Victor medical, Aeonmed, Mindray, NeuSoft, Comen, Dirui, Sonoscape, Yuwell, Shinva-БНХАУ. Micon, MGB-Герман. МЕК-ICS, Bionet, Daihan labtech, Bionics-Солонгос. Оricare, Balton, GE Healthcare, Biometrix-АНУ. Мед Теко, Медаппаратур-ОХУ. Emsas, EMS, Novos Medical System, Ari medical-Турк зэрэг 200 гаруй үйлдвэрлэгчид болон ханган нийлүүлэгч байгууллагуудтай дистрибюторийн болон шууд гэрээний үндсэн дээр хамтран ажилладаг. \n\nҮйлчилгээ: \n- Эмнэлгийн тоног төхөөрөмж угсрах, суурилуулах, ханган нийлүүлэх - Эмнэлгийн тоног төхөөрөмж засвар үйлчилгээ үзүүлэх - Эмнэлгийн тоног төхөөрөмжийн дагалдах хэрэгсэл болон сэлбэгээр хангах - Эм, эмнэлгийн багаж, хэрэгсэл, урвалж бодис ханган нийлүүлэх - Эрүүл мэндийн салбарын судалгаа болон төсөл хийх, зөвлөх үйлчилгээ үзүүлэх \n\nВэбсайт: http://iveeltgun.khas.mn/?\n\n\n\n',NULL,'Kilo Sponsor ','2019-09-23 03:37:52','2019-10-14 22:28:57',215,NULL,'Ивээн тэтгэгч'),(81,'Shinjyuku Medical Equipment',NULL,'Бидний тухай\nШинжьюкү ХХК 2011 онд Япон Улсын JICA-н төсөл хэрэгжүүлэгч компаниар үйл ажиллагаа эхлүүлэн байгуулагдана ажиллаж ирсэн.\nМанай компани 2015 оноос эхлэн дэлхийн бренд Mindray компанитай хамтран ажиллаж, 2018 онд тус компанийн Монгол дахь албан ёсны онцгой эрхтэй дистрибютерээр ажиллаж байгаа.	\n 	Бид чанартай бүтээгдэхүүн үйлдвэрлэгчээс хамгийн хямдаар төлбөрийн уян хатан нөхцөлтэйгөөр танд хүргэхээс гадна, баталгаат хугацаа, мэргэжлийн засвар үйлчилгээ, сургалт зэргээр хангана.\n 	Манай оффис Улаанбаатар хотын Хан-Уул дүүргийн 1-р хороонд байрлах Их-Хуралдай оффисын 1107 тоотод байрлах ба оффисын утас 77131133.\n 	\nХАМТДАА ХӨГЖЬЕ ШИНЖЬЮКҮ ХХК\n\nФэйсбүүк хуудас: https://www.facebook.com/mongoliamindray/\n\n\n',NULL,'Ивээн Тэтгэгч','2019-10-09 23:45:23','2019-10-14 22:28:27',221,NULL,'Алтан ивээн тэтгэгч'),(82,'МэндМН',NULL,'“Мэнд эм эн эм” ХХК нь гадаад болон дотоодод олон жил мэдээлэл технологийн чиглэлээр ажилласан туршлагатай залуучуудаас бүрдсэн технологийн баг, нөгөө талаас эмнэлгийн салбартаа манлайлагч эмнэлгийн мэргэжилтнүүдийн нэгдсэн мэргэшсэн мэргэжилтнүүдийн баг бөгөөд хиймэл оюун, блокчэйн технологид суурилсан МэндМН хэмээх ухаалаг эрүүл мэндийн туслах болон эрүүл мэндийн мэргэжилтнүүдийн нэгдсэн сүлжээг Монгол улсдаа амжилттай нэвтрүүлэхээр хичээнгүйлэн ажиллаж байна. Бидний анхны бүтээгдэхүүн болох Мэндмн аппликэйшний “Мэнд эвэнт” маань амжилттай хийгдсэн бөгөөд өнөөдрийн байдлаар “Монголын Нөхөн Сэргээх Гоо Сайхны Мэс Засалчдын Холбооны  олон улсын гуравдугаар уулзалт”, “Монголын Дүрс Оношилгооны Эмч Нарын Үндэсний Чуулган-2019” “Монголын Өрхийн Эмнэлгүүдийн үүсч хөгжсөний 20 жилийн ой ” зэрэг уулзалт хурлуудыг дижитал хэлбэрээр тус тус зохион байгуулахаар ажиллаж байна.\n\nВэбсайт: https://mend.mn/\n',NULL,'Хамтран зохион байгуулагч','2019-10-09 23:48:06','2019-10-14 22:28:21',221,NULL,'Зохион байгуулагч'),(83,'Монос ХХК',NULL,'Монголын анхны хувийн хэвшлийн эмийн сан болох Монос эмийн сан нь өдгөө нийслэл болон хөдөө орон нутагт хамгийн өргөн сүлжээ бүхий үндэсний эмийн сан, анхны фарммаркет буюу өөртөө үйлчлэх эмийн сан, анхны ахмадын эмийн сан, анхны эмийн сан & гоо сайхны салбар дэлгүүр, эрүүл мэндийн лавлах утасны үйлчилгээ, онлайн худалдаа, хүргэлт зэрэг Монголдоо анхдагч, шинэлэг үйлчилгээ болгоныг нэвтрүүлэн амжилттай ажиллаж байна.\n\nВэбсайт: http://www.monos.mn/mn/\n\n',NULL,'Ивээн Тэтгэгч','2019-10-09 23:52:56','2019-10-14 22:28:18',221,NULL,'Алтан ивээн тэтгэгч'),(84,'Gedeon Richter Mongolia',NULL,'Name of Company: Chemical Works of Gedeon Richter Plc. \nAbbreviated name of the Company:​ Gedeon Richter Plc. \nSeat of the Company: ​1103 Budapest, Gyömrői út 19-21., Hungary​ \nBranch offices of the Company: ​2510 Dorog, Esztergomi út 27., Hungary​ 4031 Debrecen, Richter Gedeon u. 20., \nHungary​ Mailing address: 1475 Budapest, P. O. Box 27, Hungary ​\nCourt of Registration: Company Court of Budapest-Capital Tribunal ​\nCompany registration number: Cg. 01-10-040944​ \nTax No.: 10484878-2-44 ​\nEU Community VAT Identification No.: HU 10484878​ ​\nPhone: +36 1 431 4000​​ ​\nFax: +36 1 260 4891​\n\nhttp://www.richter.hu/en-US/Pages/default.aspx\n\n',NULL,'Ивээн Тэтгэгч','2019-10-09 23:57:37','2019-10-14 22:28:12',221,NULL,'Алтан ивээн тэтгэгч'),(85,'“АЗИ ФАРМА” ХХК',NULL,'“АЗИ ФАРМА” ХХК нь өнөөдрийн байдлаар 395 гаруй ажиллагсадтай, нийслэл болон орон нутагт 12 эм ханган нийлүүлэх\nтөв, сүлжээ эмийн сангийн 30 салбартайгаар үйл ажиллагаа явуулж, хүн амын эрүүл мэндийн хэрэгцээнд чанартай,\nбаталгаатай эм, эмнэлгийн хэрэгслийн бараа бүтээгдэхүүнийг ханган нийлүүлэн ажиллаж байна. \nБид эмийн бүртгэлийн асуудалд онцгойлон анхаарч олон улсын түвшинд хүлээн зөвшөөрөгдсөн, Монгол Улсын эмийн бүртгэлд бүртгэгдсэн чанар аюулгүй байдлыг хангасан эмийг зах зээлд нийлүүлэн дэлхийн эрүүл мэндийн шинжлэх ухаанд гарсан ололт амжилт, технологи, иноваци шингэсэн эм бэлдмэлийг хүн арддаа хүргэж, өвчлөлийг түргэн хугацаанд эмчлэх, өвчилсөн хойноо биш өвдөхөөсөө өмнө урьдчилан сэргийлэх дадлыг бий болгон эрүүл мэндийг сахин хамгаалах, амьдралын чанарыг дээшлүүлэхэд өөрийн хувь нэмрээ оруулан ажиллаж байна. \n Импортын болон дотоодын 6000 гаруй нэр төрлийн эм, эмнэлгийн хэрэгслүүдээр 1200 гаруй эмийн сан, улсын болон хувийн хэвшлийн эмнэлгүүдийн хэрэгцээг хангаж, тэдний үйл ажиллагааны тасалдалгүй ажиллах нөхцөлийг бүрдүүлэн, ард иргэдийнхээ эрүүл энхийг сахин хамгаалах хариуцлагатай бөгөөд нэр хүндтэй үүргийг хүлээсээр байна\n\nВэбсайт: http://www.asiapharma.mn/home.shtml\n\n',NULL,'Ивээн Тэтгэгч','2019-10-09 23:59:01','2019-10-14 22:28:08',221,NULL,'Алтан ивээн тэтгэгч'),(86,'APU Company',NULL,'Тэртээ 1924 онд Монгол Улсын хүнсний үйлдвэрлэлийн эхлэл суурь болж, нэгэн зууны турш үйл ажиллагаагаа тасралтгүй явуулж буй APU Company нь салбартаа манлайлж, нийгмийн сайн сайхны төлөө, байгаль эх дэлхийдээ ээлтэйгээр, хүний хөгжлийг дээдлэн, эх орныхоо хөгжил цэцэглэлтэд өөрсдийн хувь нэмрээ оруулж яваа ууган үйлдвэрлэгч билээ.\n\nВэбсайт: http://www.apu.mn/',NULL,'Ивээн Тэтгэгч','2019-10-10 00:00:45','2019-10-14 22:28:03',221,NULL,'Алтан ивээн тэтгэгч'),(87,'Юнител групп',NULL,'Юнител групп нь үүрэн холбоо, IPTV, интернэт, суурин утасны гурвалсан үйлчилгээ, сансрын холбоо, өргөн зурвасын сүлжээ, сансрын сүлжээ, гар утасны контентын цогц үйлчилгээг үзүүлж Монгол улсын эдийн засаг, мэдээлэл технологийн салбарт өөрийн бодитой хувь нэмрээ оруулсан ҮНДЭСНИЙ ХЭМЖЭЭНИЙ ГРУПП компани юм.\n\nВэбсайт: https://www.unitel.mn/unitel/',NULL,'Ивээн Тэтгэгч','2019-10-10 00:05:09','2019-10-14 22:27:58',221,NULL,'Алтан ивээн тэтгэгч'),(88,'ЭНТО',NULL,'Эрүүл монгол хүний, Эрхэм туслах ЭНТО компани.\n\nВэбсайт: http://ento.mn/',NULL,'Ивээн Тэтгэгч','2019-10-10 00:07:21','2019-10-14 22:27:26',221,NULL,'Алтан ивээн тэтгэгч'),(89,'Sandoz эмийн компани ',NULL,'Швейцарийн 120 гаруй жилийн түүхтэй эм үйлдвэрлэлийн Сандоз компани нь анх 1886 онд химийн үйлдвэрээс үйл ажиллагаагаа эхэлж байсан ба эдүгээ женерик эмийн үйлдвэрлэлээрээ дэлхийд тэргүүлэгч компани болтлоо өргөжин хөгжиж үйл ажиллагаагаа явуулж байна. “Сандоз” компани маань дэлхийн эмийн зах зээлд шинэ молекул, шинэлэг санаагаараа тэргүүлэгч “Новартис” группын бүрэлдэхүүнд ордог. Дэлхийн 130 гаруй улс оронд өөрийн үйл ажиллагаагаа явуулж, дэлхийн 5 тивд 30 гаруй эмийн үйлдвэр, 10 гаруй судалгаа шинжилгээний төвтэй.\n\nСандоз компани маань Монгол улсын эмийн зах зээлд 2007 оноос эхлэн үйл ажиллагаагаа явуулж ирсэн ба энэ хугацаанд өндөр чанар, өргөн сонголт, хүртээмжит үнэтэй, дэлхийн жишигт хэрэглэгдэж буй женерик эм бэлдмэлүүдийг өөрийн улсын мянга мянган хэрэглэгчдэд хүргэж, тэдгээрийг өвчин зовиураас урьдчилан сэргийлж, эмчлэх зорилго тавин монгол улсын зах зээлд нэвтрүүлэхээр чармайн ажиллаж байна.\n\n',NULL,'Ивээн Тэтгэгч','2019-10-10 00:12:28','2019-10-14 22:27:22',221,NULL,'Алтан ивээн тэтгэгч'),(90,'Astellas LLC',NULL,'Since being launched in the U.S. in 2012, XTANDI is now available around the world, including in Europe, Japan and Asia. Since the launch, it has obtained additional indications for the earlier stages of prostate cancer and has been contributed to the treatment of many patients. With a strong presence in the urological field and leveraging abundant data based on accumulated clinical experience since its launch, Astellas aims for further penetration for the indications it has already received.\n\nAcute Myeloid Leukemia (AML) Treatment\nXOSPATA\nXOSPATA is a FLT3 inhibitor for adult patients with relapsed or refractory Acute Myeloid Leukemia (AML) with a FLT3 mutation-positive.\n\nIt obtained approval for the indication of relapsed or refractory AML with FLT3 mutation-positive in Japan in September 2018 and in the U.S. in November. It was launched in both countries in December 2018. Astellas also filed an application for approval in Europe in February 2019. The launch of XOSPATA contributes to treating AML by providing another treatment option for healthcare professionals involved in treating AML.\n\nOveractive Bladder (OAB) Treatment\nBetanis/Myrbetriq/BETMIGA\nBetanis/Myrbetriq/BETMIGA for the treatment of OAB is a beta-3 adrenergic receptor agonist. It improves various symptoms associated with OAB, such as urgency, urinary frequency, and urge urinary incontinence, by a new mode of action different from the anticholinergic drugs used in standard treatment.\n\nSince the first launch in Japan in 2011 under the brand name of Betanis, the product is now launched as Myrbetriq in the Americas, and BETMIGA in Europe and Asia & Oceania. Astellas aims to maximize the product value by ensuring that more physicians understand the balance between efficacy and tolerability, the feature of this product.\n\nImmunosuppressants\nPrograf and Advagraf/Graceptor/ASTAGRAF\nPrograf and Advagraf/Graceptor/ASTAGRAF are an immunosuppressant used to suppress organ transplant rejection. Although the patent for this drug has already expired in major countries, it continues being used in transplants area globally as well as contributing to treatment for autoimmune diseases such as rheumatoid arthritis and ulcerative colitis in Japan.\nOthers\nOAB treatment:                                                   Vesicare\nProstate cancer treatment:                              Eligard\nBenign prostatic hyperplasia treatment:    Harnal/Omnic\nAntifungal agent:                                                Funguard/MYCAMINE\n\n',NULL,'Ивээн Тэтгэгч','2019-10-10 00:36:03','2019-10-14 22:26:45',221,NULL,'Алтан ивээн тэтгэгч'),(91,'Bionorica SE',NULL,'Bionorica is one of the leading global manufacturers of herbal medicines. Our vision is to make medicine ever more plant-based with each day that passes. We combine modern pharmaceutical research with the effects of plants. We have hereby been producing medicines that are effective and also well-tolerated for over 85 years.\n\nВэбсайт: http://english.bionorica.de/',NULL,'Ивээн Тэтгэгч','2019-10-10 00:42:04','2019-10-14 22:24:57',221,NULL,'Алтан ивээн тэтгэгч'),(92,'Монголын эх баригчдын нийгэмлэг',NULL,'\n\nВэбсайт: http://mongolianmidwives.mn/',NULL,'Ивээн Тэтгэгч','2019-10-10 00:46:52','2019-10-14 22:15:04',221,NULL,'Алтан ивээн тэтгэгч'),(93,'IVCO',NULL,'АЙВИКО ХХК нь 2004 онд Их Британи, Австрали, Тайвань, БНСУ, Монгол улсын хамтарсан хөрөнгө оруулалттай байгуулагдсан. Эрүүл мэндийн салбарт нэн чухал шаардлагатай 30-аад нэрийн судсаар сэлбэх шингэн болон 20-ид төрлийн тарилгын уусмалуудыг үйлдвэрлэж эрүүл мэндийн байгууллагуудыг тасралтгүй хангаж байна.\n\nМонгол улсаас анх удаа олон улсын болон үндэсний GMP (Good Manufacturing Practice) буюу Үйлдвэрлэлийн Зохистой Дадлын шаардлагыг бүрэн хангаж батламж авсан, Чанарын удирдлагын  ISO 9001 тогтолцоог үйл ажиллагаандаа цогцоор нэвтрүүлж буй Монголын анхны судсаар сэлбэх тарилгын эмийн үйлдвэр юм. \n\nАНУ-ийн ROMACO группын Франц дахь салбар IPM компаниас нийлүүлсэн зориулалтын байр–модуль, IPM болон БНСУ-ын FINE F.A.C компаниас нийлүүлсэн тоног төхөөрөмж khow-now-тай.\n\n2009 онд БНСУ-ын FINE F.A.C компанитай хамтран тоног төхөөрөмжийн өргөтгөл хийн хүчин чадлыг  нэмэгдүүлсэнээр үйлдвэрлэлийн тоо хэмжээг жилд 8 сая ширхэгт хүргэн эрүүл мэндийн байгууллагуудыг  аюулгүй, эмчилгээний өндөр идэвхитэй, чанарын баталгаатай судсаар сэлбэх шингэнээр тасралтгүй хангаж байна.\n\n2013 онд бага эзэлхүүнтэй тарилгын уусмалын үйлдвэрлэлд дэлхийд тэргүүлэгч савлагааны дэвшилтэт технологи болох ПП(полипропилен) буюу пластик савлагаатай тарилгын уусмалын шинэ шугам нэвтрүүлсэн. Энэхүү шугам нь жилд 15 сая ширхэг тарилгын уусмал үйлдвэрлэх хүчин чадалтай юм. Мөн нэр төрлөө тогтмол нэмж хэрэглэгчдэд ямар нэгэн эрсдэлгүй, аюулгүй, чанартай тарилгын уусмал нийлүүлж байна.\n\nМанай компани нь дэлхийд системийн хөгжүүлэлт, програмын шийдлээрээ тэргүүлэгч Odoo apps компаний OPEN ERP байгууллагын нөөц төлөвлөлтийн системийг 2013 оноос хойш идэвхтэй хэрэгжүүлсний үр дүнд 2014 онд компаний бүх хэсэгт амжилттай нэвтрүүлж чадсан. Манай компани цаашид үйл ажиллагаагаа өргөжүүлж дэлхийн түвшинд өрсөлдөхийг хүсвэл үйлдвэрлэл, бараа бүртгэл, санхүү, борлуулалт гэсэн хэсгүүдэд уг системийг амжилттай ашиглаж илүү хөгжүүлэх нь чухал юм.\n\nВэбсайт: http://www.ivco.mn/\n\n',NULL,'Ивээн Тэтгэгч','2019-10-10 00:49:10','2019-10-14 22:26:56',221,NULL,'Алтан ивээн тэтгэгч'),(94,'Bayer',NULL,'БАЙЕР – радиологийн салбарт дэлхийд тэргүүлэгч компани бөгөөд тодосгогч бодис болон PET, СҮТ, KT, ангиографид зориулагдсан MEDRAD ® автомат тарилгын систем үйлдвэрлэгч төдийгүй  радиологийн салбарыг хөгжүүлэгч гэдгээр дэлхийд хүлээн зөвшөөрөгдсөн компани.\n\n#303, Office center «Azmon»\nEnkhtaivan avenue – 50,\ndist. Sukhe-Bator, 1 khoroo,\n17000  Ulaanbaatar,\nMongolia\nMob:      +976 99098457\nE-mail:  erdenetulga.pagd.ext@bayer.com\n\n',NULL,'Ивээн Тэтгэгч','2019-10-10 00:50:16','2019-10-14 22:26:59',221,NULL,'Алтан ивээн тэтгэгч'),(95,'МОНФА ТРЕЙД ХХК ',NULL,'Манайх 1998 онд байгуулагдсан, Монголын эм ханган нийлүүлэх ууган байгууллагын нэг юм. Одоо Улаанбаатар, Дархан, Эрдэнэт, Баянхонгор, Архангай, Ховд, Өвөрхангай, Хөвсгөл зэрэг аймагт салбартай. Улаанбаатар хотод 2 бөөний төв, 10 гаруй эмийн сан ажиллуулж, Улсын томоохон эмнэлгүүд, Аймгийн нэгдсэн эмнэлэг, Эрүүл мэндийн газарт тендерээр эм, эмнэлгийн хэрэгсэл, оношлуур нийлүүлж байна. Манай байгууллага ОХУ, Герман, Чех, АНУ болон манай АШУҮИС-ийг төгссөн эм зүйч, эмч, анагаахын чиглэлээр өндөр боловсрол бүхий мэргэжлийн боловсон хүчнээс бүрдсэн эвсэг, чадварлаг хамт олныг бий болгосон юм. Өндөр чанартай эм, эмнэлгийн хэрэгслээр байгууллагууллага иргэдийг боломжийн үнээр, шуурхай, найдвартай үйлчлэхэд манай эрхэм зорилго оршино. Энэхүү эрхэм зорилгоо амжилттай хэрэгжүүлэхдээ дор дурдсан стратегийн бодлого баримталдаг.\n\nВэбсайт: http://monfatrade.mn/\n\n',NULL,'Ивээн Тэтгэгч','2019-10-10 00:54:20','2019-10-14 22:27:15',221,NULL,'Алтан ивээн тэтгэгч'),(96,'Нийслэлийн Хүрээ амаржих газар ',NULL,'Танилцууулга\nБүгд Найрамдах Монгол Ард улсын Сайд нарын зөвлөлийн тогтоолоор 1959 оны Хан-Уул дүүргийн нэгдсэн эмнэлэгт 4 ортой төрөх тасаг нээгдсэнээр суурь нь тавигджээ. Улмаар Эрүүлийг хамгаалах яамны сайдын 1959 оны 12-р сарын 26-ны 244 тушаалаар одоогийн байранд 75 ортойгоор II амаржих газар нэртэйгээр нээгджээ.\nБайгууллагын үйл ажиллагаа, үндсэн чиглэл:\nСонгино-Хайрхан дүүргийн 22 хорооны 68000 гаруй нөхөн үржихүйн насны эмэгтэйчүүдэд эх барихын нарийн мэргэжлийн тусламж үйлчилгээг үзүүлж байна.\n2014 онд Нийслэлийн эрүүл мэндийн газрын даргын А/97 тоот тушаалаар “НИЙСЛЭЛИЙН ХҮРЭЭ АМАРЖИХ ГАЗАР” нэртэйгээр үйл ажиллагаагаа явуулж байна.\n\nЭрхэм зорилго\nШинжлэх ухаан, технологийн ололтыг нэвтрүүлж, чанарыг эрхэмлэж, эх барихын тусламж үйлчилгээний бүх түвшинд мэргэжлээрээ манлайлагч байна.\n\nУриа:\n“Эрүүл эх, нярай-Эх орны ирээдүй”\n\nЗорилт:\n• Үйлчлүүлэгч төвтэй эмнэлгийн тусламжийг эрхэмлж, харилцаа хандлагыг дээшлүүлэх\n• Эх барихын тусламж үйлчилгээний чанарыг10 %иар нэмэгдүүлж чанарын брендийг нэвтрүүлэх\n• Эрүүл мэндийн хэрэгцээ, нотолгоонд суурилсан тусламж үйлчилгээг хөгжүүлж судалгаа эрдэм шинжилгээний ажлыг дэмжих\n• Эх барихын тусламж үйлчилгээнд харилцаа, хамтын ажиллагаа багыг ажлыг нэмэгдүүлж ноцтой хүндрэлийг 5 % бууруулах багаж тоног төхөөрөмжийн хангалтыг дэс дараалалтай нэмэгдүүлж, Шинжлэх ухаан, технологийн ололт, иновацийг дэмжих\n\nБаримтлах зарчим\n• Тэгш эрхийн зарчим\n• Манлайлалын зарчим\n• Нийгмийн зөвшил, оролцооны зарчим\n• Эрэлт хэрэгцээнд нийцсэн байх зарчим\n\nВэбсайт: http://khuree-amarjikh.ub.gov.mn/\n\n',NULL,'Ерөнхий зохион байгуулагч','2019-10-10 00:57:46','2019-10-14 22:27:08',221,NULL,'Ерөнхий зохион байгуулагч'),(97,'Монголын эх барих эмэгтэйчүүдийн эмч нарын холбоо ',NULL,'Монголын эх барих эмэгтэйчүүдийн эмч нарын Холбоо нь Монгол улсын харьяат, эх барих, эмэгтэйчүүдийн мэргэжлийн болон түүний салбар мэргэшил бүхий их эмч нарын ажил мэргэжлийнхээ өвөрмөц онцлог, эрх ашгийн үүднээс сайн дурын үндсэн дээр эвлэлдэн нэгдсэн, ашгийн төлөө бус, гишүүддээ үйлчлэх төрийн бус байгууллага юм.\n\nМонгол улсын өнцөг булан бүрт ажиллаж буй эмч нар сайн дураараа эвлэлдэн нэгдэж 1989 онд тус холбооны үндэс суурийг Монголын эх барих, эмэгтэйчүүдийн эмч нарын нийгэмлэг нэртэйгээр байгуулсан түүхтэй.\n\nХолбооны зорилго:\n\nЭх барих, эмэгтэйчүүдийн эмч - гишүүдийнхээ мэргэжлийн мэдлэг, ур чадварыг дээшлүүлэх, туслаж дэмжих, хамтын бүтээлч сэтгэлгээг хөгжүүлэх, онцлог ёс зүйг эрхэмлэн эрх ашиг, нэр төрийг хамгаалах\n\nЭмч нарынхаа идэвх санаачлага, оролцоог нэмэгдүүлэх замаар эх хүүхэд, гэр бүл, эмэгтэйчүүдийн эрүүл мэндийн шатлалын тусламжийн чанар, хүртээмжийг дэлхий нийтийн өнөөгийн түвшинд хүргэхэд дэмжлэг үзүүлэх\n\nВэбсайт:  http://www.mfog.mn/mn/\n\n',NULL,'Хамтран зохион байгуулагч','2019-10-10 00:59:01','2019-10-14 22:27:12',221,NULL,'Зохион байгуулагч'),(98,'Med Trauma Hospital ',NULL,'Манай эмнэлэг  нь 2013 онд байгуулагдсан бөгөөд улсын хэмжээнд Гэмтэл, согогийн тусламж үйлчилгээ үзүүлэх амбулaтори болон мэс заслын хэвтэн эмчлүүлэх 15 ортой тасаг, Орчин үеийн дэвшилтэт тоног төхөөрөмж болох Соронзон үелзүүрт томографи-MRI, Компьютерт томографи-СТ, Дижитал рентген, зэрэг Дүрс оношилгооны тусламж үйлчилгээг 24 цагийн турш чанартай, найдвартай үзүүлж байна. \n\nХаяг: Баянгол дүүрэг 7-р хороо, Ард Аюушийн гудамж 90/6-р байр\n\nХолбоо Барих: 77110351, 77110352\nВэбсайт: http://medtrauma.mn/\n',NULL,'Ивээн Тэтгэгч','2019-11-07 01:24:40','2019-11-07 01:31:47',223,NULL,'Алтан ивээн тэтгэгч'),(99,'Encore Veritas',NULL,'“Энкор веритас ” ХХК 2011 онд байгуулагдсан. \nБид Монгол улсын зах зээлд нэн шинэ эм, эмнэлгийн хэрэгслийг танилцуулж, чанартай, баталгаатай, аюулгүй бүтээгдэхүүнээр хүн амын эрүүл мэндийг дэмжин ажиллахаар зорьж байна. \n\n2013 оноос Солонгос улсын тэргүүлэгч эмийн үйлдвэрлэгч Донгүүг Фармацетикал ХХК-тай хамтран ажиллаж байгаа юм. Энэхүү хамтын ажиллагааны хүрээнд Солонгос улсын тодосгогч бодисын зах зээлийн 80 хүртэлх хувийг хангадаг Памирей 300, Памирей 370 тодосгогч бодисыг Монголын зах зээлд нийлүүлж эхэлсэн билээ. Памирей брендийн энэхүү бүтээгдэхүүн Солонгос төдийгүй дэлхийн 20 гаруй оронд аюулгүй, бөөр хордуулах нөлөө, харшлын урвал бага, зургийн чанар сайн зэрэг давуу талаараа дэлхийд танигдсан бүтээгдэхүүн билээ. Мөн Донгүүг Фармацетикал ХХК-ийн гол нэрийн бүтээгдэхүүн, тэр дундаа дэлхийд алдартай Гиалуроны тарилга (Гиарон), мэсгүйгээр арьс өргөх бүтээгдэхүүнүүд, сүүлийн үеийн антибиотик зэргийг Монгол улсын зах зээлд хямд үнээр нийлүүлж байна. \nЦаашлаад, Монгол улсын нас баралтын гол шалтгаан болж буй Зүрх судасны өвчлөлийн үед хэрэглэдэг ховор эмүүд, зүрхний хэм алдагдлын эмүүдийг нийлүүлж, хүн амын өвчлөл, өвчлөлөөс шалтгаалсан хүндрэлийг бууруулахад эмч нартайгаа хамтран ажиллаж байна. \nХүн амын дундах ходоодны хорт хавдрын өвчлөл, илрүүлгийн үйл ажиллагаанд өөрсдийн хувь нэмрийг оруулах үүднээс, богино хугацаанд, өндөр үр дүнтэй ариутгах дурангийн ариутгалын бодис Ортофталальдегидын уусмалыг үйлдвэрлэгчээс нь хямд үнээр нийлүүлж эхэллээ. Ортофталальдегидийн уусмал нь шинэ үеийн өндөр түвшний ариутгалын бодис ба ариутгалын бодист тэсвэртэй микобактерийн халдвар, эмэнд тэсвэртэй сүрьеэ, элэгний В, С вирусын бохирдлыг богино хугацаанд, гүйцэт ариутгахаас гадна дурангийн ариутгал гүйцэтгэж байгаа сувилагч, эмнэлгийн мэргэжилтэн, дуранг хэрэглэж байгаа сувилагч, эмч нарт харшил төрүүлэх гаж нөлөө багатай зэрэг маш олон давуу талтай бүтээгдэхүүн билээ. Монгол оронд эмнэлгийн нөхцөлд ихээр бүртгэгдэх болсон MRSA-ийн халдварын үед хэрэглэдэг дасал үүсгэх шинжгүй, Тейкон антибиотикийг мөн нийлүүлж эхэллээ. Тейкон буюу тейкопланиныг дэлхий даяараа Ванкомицинд дасалтай нянгийн халдварт хэрэглэдэг ба остеомиелит, эндокардит, перитонит, түлэгдэл, элэг шилжүүлэн суулгасан өвчтөний халдвараас хамгаалах зорилгоор хэрэглэдэг билээ. \n\nУтас: 9919-9276, 91916613, 70116613 \n\nЦахим шуудан:  evcompany@yahoo.co.uk \n\n\n',NULL,'Ивээн Тэтгэгч','2019-11-07 01:28:35','2019-11-07 07:08:51',223,NULL,'Алтан ивээн тэтгэгч'),(100,'Гэрлийн Пүрэв сан',NULL,'Гэрлийн Пүрэв сангийн зорилго:\n- Монгол Улсын Төрийн соёрхолт, анхны “Ардын эмч”, АУҮХ-ийн “Хүндэт профессор”, Монголын Рентген Радиологийн нийгэмлэгийн “Хүндэт гишүүн” Р.Пүрэвийн рентген, ангиографи ба компьютерт томографи шинжилгээ, оношлогоо \n- Эрдэм шинжилгээ-судалгааны ажлыг судлан өвлөх , хойч үеийнхэнд нь эзэмшүүлэх, бүтээлийг нь хэвлүүлэх, сурталчилах\n- Дүрс оношлогооны мэргэжлийн эмч нарыг мэргэжүүлэх, мэргэжлийг дээшлүүлэх\n- Дүрс оношлогооны эмч, инженер ба техникч нарын мэргэжлийн үйл ажиллагааг урамшуулах, дэмжлэг туслалцаа үзүүлэхэд оршино. \n\nЖил бүр тогтмол хийдэг ажлууд:\n- Сургалт, семинар, мэргэшүүлэх сургалт \n- Ном товхимол, илтгэл өгүүлэл\n- Шинэ технологи \nНэвтрүүлсэн шинэ технологи:\n2010 оноос рентген харалтын хяналт дор нугалмайд озон шахах эмчилгээ ММЗ, пейсмэйкер тавих ЗМЗ эмч нартай хамтран\n2014 оноос “Мөчдийн артерийн судасны КТГ”-ийн шинжилгээ улсад анх удаа \nКТГ-ийн хяналтан дор уушги ба элэгний эмгэгээс эдийн шинжилгээ авах ажилбар эмнэлэгт анх удаа \nКТГ-ийн боловсруулалтыг MIP дүрслэлээр УАББ, тархины артерийн судасны цүлхэн, элэг болон цуллаг эрхтний хавдрын судасжилтыг хялбар илрүүлэх\n2015 оноос “Whole body artery” улсад анх удаа “Зүрхний титэм судасны КТГ”-ийн шинжилгээ тус эмнэлэгт  анх удаа\n2015 оноос хэт авиан хяналт дор бамбай булчирхай, элэгний эдийн шинжилгээ, бөөрний стент тавих, давсагны цистотомийн гуурс тавих \n2018 оноос УАББ+Гүний венийн бүлэнг КТ-р илрүүлэх\n2019 онд тархи болон зүрхний MRI шинжилгээ хийж эхэлсэн.\n\n',NULL,'Ерөнхий Зохион Байгуулагч','2019-11-07 05:38:58','2019-11-07 07:09:14',223,NULL,'Ерөнхий зохион байгуулагч'),(101,'Sammit Medical Service LLC',NULL,'“Саммит Медикал Сервис” ХХК нь 2011 онд байгуулагдсан бөгөөд эрүүл мэндийн\nүйлчилгээ эрхэлдэг байгууллагуудад эм, эмнэлгийн хэрэгсэл, тоног төхөөрөмж ханган\nнийлүүлэлдэг компани юм.\n\nМанай компаний эрхэм зорилго:\nДэлхийн брэнд болсон чанарын баталгаа, аюулгүй ажиллагааны шаардлага хангасан өндөр\nтехнологи бүхий эмнэлгийн тоног төхөөрөмж, эм, эмнэлгийн хэрэгслээр Монгол улсын эрүүл\nмэндийн байгууллагуудыг хангаж, хүн амд үзүүлэх эрүүл мэндийн оношлогооны тусламжийг\nшинэ шатанд гаргах юм.\n\nБүтээгдэхүүн: \n- Эм\n- Эмнэлгийн хэрэгсэл\n- Эмнэлгийн тоног төхөөрөмж\n- Тоног төхөөрөмжийн засвар, үйлчилгээ\n Вэбсайт: https://www.facebook.com/SummitMedicalService/\n\n\n',NULL,'Ивээн тэтгэгч','2019-11-07 05:44:12','2019-11-07 07:08:35',223,NULL,'Алтан ивээн тэтгэгч'),(102,'JICA',NULL,'ЖАЙКА нь дараах 3 тэргүүлэх салбар, 8 хөгжлийн асуудлыг шийдвэрлэх арга хэмжээг хамтын ажиллагааны чиглэл болгон үйл ажиллагаагаа өргөжүүлж байна. 1. Макро эдийн засгийн эрүүл үйл ажиллагаа ба засаглалыг бэхжүүлэх Макро эдийн засгийг тогтворжуулан, эдийн засгийн тогтвортой хөгжлийг хангахын тулд \"төрийн санхүүгийн удирдлагын чадавхийг сайжруулахын\" зэрэгцээ санхүүгийн зах зээлийг бэхжүүлэн, хөрөнгө оруулалтын орчныг боловсронгуй болгосноор \"эрчимтэй зах зээлийн эдийн засгийг бүрдүүлэхэд чиглэсэн дэмжлэгийг\" үзүүлнэ. 2. Хүрээлэн буй орчинтой зохицсон эдийн засгийн тэнцвэртэй өсөлтийг хангах Нийслэл Улаанбаатар хотын хэт төвлөрлийг бууруулах, ашигт малтмалын салбараас хараат эдийн засгийн бүтцээс ангижрахын тулд \"аж үйлдвэрийг төрөлжүүлэх, бүс нутгийн хөгжлийн стратегийг бэхжүүлэхийн\" зэрэгцээ эдийн засгийн \"өсөлтийг хангахуйц өндөр чанартай дэд бүтцийг байгуулах\" болон \"хүрээлэн буй орчинд ээлтэй, аюулгүй хот болгон хөгжүүлэхийг\" дэмжинэ. 3. Хүртээмжтэй нийгмийг бий болгох Орлогын түвшин, хот, хөдөөгийн ялгааг (боловсрол, эрүүл мэнд, халамж зэрэг) арилгахын тулд \"нийгмийн шаардлагад нийцсэн эрүүл мэндийн тусламж үйлчилгээний стандартад хүрэх\" болон \"нийгмийн суурь үйлчилгээний чанарыг сайжруулах\", \"хөгжлийн бэрхшээлтэй иргэдийн нийгмийн оролцоог сайжруулахад\" дэмжлэг үзүүлнэ.\n\nВэбсайт: https://www.jica.go.jp/mongolia/mon/index.html\n\n\n',NULL,'Ивээн Тэтгэгч','2019-11-07 05:52:14','2019-11-07 07:08:19',223,NULL,'Алтан ивээн тэтгэгч'),(103,'Анагаах Ухааны Хүрээлэн',NULL,'Т.Шагдарсүрэнгийн нэрэмжит Анагаах Ухааны Хүрээлэн нь эрдэм шинжилгээ-эмнэлзүй- сургалт  гэсэн гурвалсан чиглэлээр үйл ажиллагаа явуулж буй Монгол улсын анагаах ухаан, эрүүл мэндийн салбарын эрдэм шинжилгээний ууган, тэргүүлэгч байгууллага юм.\n\nАнагаах Ухааны Хүрээлэн улиран одож буй 50 гаруй жилийн хугацаанд олон сорилт бэрхшээлийг амжилттай даван туулж чадсан, арвин их түүхтэй, үнэт соёл, уламжлалтай ууган хүрээлэнгүүдийн нэг билээ.\n\nВэбсайт: http://imsm.mn/\nАУХ байгуулагдсан нь манай орны анагаах ухааны салбарын эрдэм шинжилгээний байгууллагын үйл ажиллагааг нэгтгэн зангидаж, шинжлэх ухааны нэгдмэл удирдлагаар хангах, эрдэм шинжилгээний боловсон хүчнийг бэлтгэн сургах, материаллаг баазыг бэхжүүлэх, гадаад харилцааг өргөтгөн хөгжүүлэх зэрэгт нэн чухал үүрэг гүйцэтгэсэн, гүйцэтгэсээр ч байна.\n\nЭрүүл мэндийн байгууллагуудтай эрдэм шинжилгээний ажил хамтран гүйцэтгэх; төгсөлтийн өмнөх, дараах, мэргэжил олгох, дээшлүүлэх сургалтанд оролцох; эрдэм шинжилгээ, эмнэлзүйн үйл ажиллагаанд зөвлөх; эмч эмнэлгийн мэргэжилтэн, магистр, докторант, олон нийтэд зориулсан сургалт семинар зохион байгуулах; эрүүл мэндийн үзлэг, хяналт үнэлгээ хийх зэрэг үйл ажиллагааг гүйцэтгэж байна.\n\nМонгол Улсын Засгийн Газрын 2015 оны 1 дүгээр сарын 26-ны өдрийн 27 тоот тогтоолоор Т.Шагдарсүрэнгийн нэрэмжит Анагаах Ухааны Хүрээлэнг Анагаахын Шинжлэх Ухааны Үндэсний Их Сургуулийн харъяанд шилжүүлсэн.\n\nАШУҮИС-ийн захирлын 2017 оны 9 дүгээр сарын 04-ний өдрийн Б/31 тоот тушаалаар АУХ-ийн захирлаар АУ-ны доктор, дэд профессор П.Эрхэмбулган томилогдон ажиллаж байна.\n\nАнагаах Ухааны Хүрээлэн дэргэдээ гарааны компани байгуулах эрх зүйн орчинг бүрдүүлэн, өөрийн орны ургамал, амьтны гаралтай түүхий эдийг ашиглан лабораторийн туршилт судалгаагаар баталгаажсан шинжлэх ухааны үндэслэлтэй үс арчилгаа, үсний уналтын эсрэг импортыг орлох, экспортын нөөцийг нэмэгдүүлсэн бүтээгдэхүүн үйлдвэрлэх зорилгоор “Гарааны Дерма лаб” ХХК-г 2016 оны 6 сард байгуулсан. “Гарааны Дерма лаб” ХХК-ны захирлаар АУ-доктор С.Мөнхбаяр ажиллаж байна.\n\n ',NULL,'Зохион байгуулагч','2019-11-07 05:58:19','2019-11-07 05:59:15',223,NULL,'Зохион байгуулагч'),(104,'\"Мэнд.мн\" Аппликэйшн',NULL,'Эрүүл мэндийн ухаалаг туслах',NULL,'Ерөнхий зохион байгуулагч','2020-07-01 00:53:34','2020-07-01 02:35:36',224,NULL,'Ерөнхий зохион байгуулагч'),(105,'“Хэйлт Маркетинг Сервисэс” ХХК',NULL,'Marketing Consultant Services include:\nWebsite development\nSite-to-site physician referral requests\nAdvertising (flyers, brochures, media, etc.)\nProject management\nMendmn application is a comprehensive tool for listing all the medical symposium, conferences and workshops for healthcare professionals in Mongolia. \n\nIt is a free application that enables healthcare workers to easily search for medical events relevant to their interests and specialization and network with other physicians, globally promote medical speakers and 