 leading global manufacturers of herbal medicines. Our vision is to make medicine ever more plant-based with each day that passes. We combine modern pharmaceutical research with the effects of plants. We have hereby been producing medicines that are effective and also well-tolerated for over 85 years',NULL,'Ерөнхий ивээн тэтгэгч','2020-10-22 17:54:01','2020-10-22 17:54:01',227,NULL,'Алтан ивээн тэтгэгч'),(112,'Berlin-Chemie',NULL,'For over 100 years, BERLIN-CHEMIE has stood for innovative research and production of newly developed as well as proven pharmaceutical products. Our goal is to introduce new drugs to help ill patients and improve their quality of life.\n \nAs part of the global MENARINI Group, the leading Italian pharmaceutical company, BERLIN-CHEMIE is responsible for the pharmaceutical markets in Germany, Eastern Europe and the CIS region.\n\nWebsite: https://www.berlin-chemie.com/',NULL,'Ерөнхий ивээн тэтгэгч','2020-10-22 17:56:46','2020-10-22 17:56:46',227,NULL,'Алтан ивээн тэтгэгч'),(113,'Ази Фарма',NULL,'“АЗИ ФАРМА” ХХК нь Монгол Улсын эм, эмийн хэрэгслийн зах зээлд 15 жилийн турш амжилттай үйл ажиллагаа эрхэлж, өнөөдрийн байдлаар 300 гаруй ажилтантай, нийслэл болон орон нутагт 12 эм ханган нийлүүлэх төв, сүлжээ эмийн сангийн 22 салбартайгаар үйл ажиллагаа явуулж, хүн амын эрүүл мэндийн хэрэгцээнд чанартай, баталгаатай эм, эмнэлгийн хэрэгслийн бараа бүтээгдэхүүнийг ханган нийлүүлэн ажиллаж байна. Бид эмийн бүртгэлийн асуудалд онцгойлон анхаарч олон улсын түвшинд хүлээн зөвшөөрөгдсөн, Монгол Улсын эмийн бүртгэлд бүртгэгдсэн чанар аюулгүй байдлыг хангасан эмийг зах зээлд нийлүүлэн хэрэглэгчдийн хэрэгцээг бүрэн хангаж ажиллахын зэрэгцээ хүн амыг эмийн зохистой хэрэглээнд хэвшүүлэхийг зорин ажилладаг. Манай компани хэрэглэгч, харилцагчиддаа олон улсын болон ДЭМБ-ын зүгээс тавигдаж байгаа стандартыг хангасан эм, эмнэлгийн хэрэгслийг хангах үйл ажиллагааг ямарваа нэгэн зөрчил дутагдалгүй чанарын өндөр түвшинд явуулдаг бөгөөд сүүлийн жилүүдэд манай харилцагчдын тоо тогтмол өсч байгаа нь бидэнд улам ихийг бүтээн байгуулах урам зоригийг өгч байна.\n\nВэбсайт:  http://asiapharma.mn/',NULL,'Ивээн тэтгэгч','2020-10-22 17:59:46','2020-10-22 17:59:46',227,NULL,'Мөнгөн ивээн тэтгэгч'),(114,'Онош-Мед',NULL,'Танилцуулга\n2004 онд эмнэлзүйн оношлогооны лабораторийн чиглэлээр үйл ажиллагаа явуулахаар байгуулагдсан Оношмед” ХХК нь биохими, гематологи, клиник хими, дархлаа судлал, эс судлал (эмэгтэйчүүдийн), молекул-биологийн шинжилгээнүүдийг хийдэг. Oлон улсад хүлээн зөвшөөрөгдсөн, чанар стандартын шаардлага хангасан тоног төхөөрөмж , урвалж оношлуурууд ашиглан, тоног төхөөрөмжөө жил тутам техникийн үзлэгт хамруулж, урвалж бодис, багаж хэрэгсэл, тоног төхөөрөмжийн ажиллах зааварчилгаа, техник үзүүлэлтийг нягт нямбай дагаж мөрдөн ажилладаг. Манай лаборатори нь нарийн мэргэжлийн чадварлаг боловсон хүчнээр хангагдсан, эмч мэргэжилтнүүдээ мэргэжлийн дагуу гадаад, дотоодод урт, богино хугацааны сургалтуудад тогтмол хамруулдаг бa клиникийн болон хувийн 30 гаруй эмнэлэг, эрүүл мэндийн байгуулагуудтай хамтын ажиллагаатай.\n\nВэбсайт: https://onoshmed.mn/',NULL,'Дэмжигч байгууллага ','2020-10-22 18:02:06','2020-10-22 18:02:06',227,NULL,'Хүрэл ивээн тэтгэгч'),(115,'Unitel',NULL,'Юнител групп нь үүрэн холбоо, IPTV, интернэт, суурин утасны гурвалсан үйлчилгээ, сансрын холбоо, өргөн зурвасын сүлжээ, сансрын сүлжээ, гар утасны контентын цогц үйлчилгээг үзүүлж Монгол улсын эдийн засаг, мэдээлэл технологийн салбарт өөрийн бодитой хувь нэмрээ оруулсан ҮНДЭСНИЙ ХЭМЖЭЭНИЙ ГРУПП компани юм.\n\nВэбсайт: https://www.unitel.mn/unitel/',NULL,'Дэмжигч байгууллага','2020-10-22 18:04:01','2020-10-22 18:04:01',227,NULL,'Хүрэл ивээн тэтгэгч'),(116,'Mendmn',NULL,'Энэхүү платформ нь Мэнд Эм Эн Эм ХХК-ийн өмч бөгөөд эрүүл мэндийн салбарын бүхий л үйл ажиллагааг салбартаа болон иргэд, олон нийтэд түгээн дэлгэрүүлэх, сурталчлах, мэдлэг мэдээлэл олж авахад ашиглагдах мөн эрүүл мэндийн тусламж үйлчилгээг технологийн дэвшилтэй уялдуулан илүү хялбар аргаар олж авахад чиглэсэн олон төрлийн үйл ажиллагааг хэрэгжүүлэхээр төсөл хөтөлбөрийг тасралтгүй хийж та бүхэндээ хүргэсээр байна. \n\nВэбсайт: \nhttps://edu.mend.mn/\nhttps://pubmend.mn/',NULL,'Хамтран зохион байгуулагч ','2020-10-22 18:05:59','2020-10-22 18:05:59',227,NULL,'Зохион байгуулагч'),(117,'Эх барих эмэгтэйчүүд судлалын тэнхим',NULL,'Эх барих эмэгтэйчүүд судлалын тэнхим',NULL,'Хамтран зохион байгуулагч','2020-10-27 00:04:44','2020-10-30 23:11:06',229,NULL,'Зохион байгуулагч'),(118,'Medimpex',NULL,'Эрүүл мэнд, лабораторийн тоног төхөөрөмж, багаж хэрэгслийн худалдаа\n\nВэбсайт: http://www.medimpex.mn/en\n\n\n\nЭмнэлэг, лабораторийн тоног төхөөрөмжийн засвар үйлчилгээ',NULL,'Ерөнхий ивээн тэтгэгч','2020-10-30 22:09:12','2020-10-30 22:15:00',229,NULL,'Алтан ивээн тэтгэгч'),(119,'Unitel',NULL,'Юнител групп нь үүрэн холбоо, IPTV, интернэт, суурин утасны гурвалсан үйлчилгээ, сансрын холбоо, өргөн зурвасын сүлжээ, сансрын сүлжээ, гар утасны контентын цогц үйлчилгээг үзүүлж Монгол улсын эдийн засаг, мэдээлэл технологийн салбарт өөрийн бодитой хувь нэмрээ оруулсан ҮНДЭСНИЙ ХЭМЖЭЭНИЙ ГРУПП компани юм.\n\nВэбсайт: https://www.unitel.mn/unitel/\n\n',NULL,'Ерөнхий ивээн тэтгэгч','2020-10-30 22:10:06','2020-10-30 22:14:33',229,NULL,'Алтан ивээн тэтгэгч'),(120,'Bayer',NULL,'Герман улсын “Байер” эмийн үйлдвэр нь 1863 онд  анх байгуулагдсан ба  156 дахь жилдээ үйл ажиллагаагаа явуулж буй дэлхийн тэргүүлэгч, оригиналь компани юм.                                                   “Байер ” компанийн   эмийн үйлдвэрлэл нь дэлхийн хөгжингүй орнууд болох  АНУ,  Австри,  Швейцари, Итали,  Герман,   улсуудад явагддаг.  Манай улсад тус компанийн эмийн бүтээгдхүүнүүд  эмийн зах зээлд орж ирээд  10 гаруй жил болж байгаа ба эмийн чанар,  үр дүн нь олон нийтэд танигдсан ба эмийн бэлдмэлүүд нь “Монос”,  “Монгол эм импекс концерн”,  “Ази фарма” зэрэг дистрибьютер эмийн сангуудаар дамжуулан зах зээлд нийлүүлэгдэж байна.\n\nВэбсайт: https://www.bayer.com/en/\n\n',NULL,'Ерөнхий ивээн тэтгэгч','2020-10-30 22:14:09','2020-10-30 22:14:09',229,NULL,'Алтан ивээн тэтгэгч'),(121,'Panaroma ',NULL,'Panorama is a non-invasive DNA screening test that can tell you important information about your pregnancy, as early as nine weeks of gestation. With Panorama, you can find out about the likelihood of your baby having a chromosomal condition, such as Down syndrome, with a simple blood test. If you so choose, you may also find out the gender of your baby.',NULL,'Ивээн тэтгэгч','2020-10-30 22:35:35','2020-10-30 23:06:14',229,NULL,'Алтан ивээн тэтгэгч'),(122,'MSUOG',NULL,'Монголын эх хүүхэд, эмэгтэйчүүдийн эрүүл мэндийн төлөө ажилладаг эх барих эмэгтэйчүүд, дүрс оношилгоо болон ерөнхий мэргэжлийн эмч, судлаач эрдэмтэд, резиденд эмч, эх баригч нартай манай нийгэмлэг хамтран ажиллахад бэлэн байна.\n\nМонголын эх барих эмэгтэйчүүдийн хэт авиан оношилгооны үндэсний  ниигэмлэг нь зөвхөн гишүүддээ үйлчилдэг ашгийн төлөө бус байгууллага бөгөөд манай нийгэмлэг нь цаашдаа эмч нарын мэдлэг чадварыг дээшлүүлэх, судалгаа шинжилгээний ажлыг дэмжих, дэлхийн оношилгоо эмчилгээний өнөөгийн түвшиний чадамж, чиг хандлага, стандартыг эмч нарт эзэмшүүлэх, олон улсын бусад нийгэмлэгээс зохиож байгаа их хурал, чуулган, анхан ба ахисан шатны сургалтанд эмч нарыг өргөнөөр оролцуулах нөхцлийг бүрдүүлэх чиглэлээр ажиллана.\n\nБие эрүүл, ухаан саруул Монголын үрс маш олон болтугай\n\nВэбсайт: https://msuog.mn/\n',NULL,'Ерөнхий зохион байгуулагч','2020-10-30 22:38:05','2020-10-30 22:38:05',229,NULL,'Ерөнхий зохион байгуулагч'),(123,'Анагаахын Шинжлэх Ухааны Үндэсний Их Сургууль',NULL,'Монгол улсын эрүүл мэндийн салбарын мэргэжилтнүүдийг эх орондоо бэлтгэж эхэлсэн далан жилийн түүхийн эхлэл 1942 онд тавигджээ. БНМАУ-ын Сайд нарын Зөвлөлийн 1940 оны 12-р сарын 06-ныөдрийн 45-р тогтоолоор Монгол Улсын Университет байгуулах шийдвэр гарч, 1942 онд 3 салбартайгаар байгуулагдсаны нэг нь Хүн эмнэлгийн факультет байлаа.\n\nЧ.Чимэддамба нь 1942 оны 10-р сарын 18-ны ректорын 1-р тушаалаар анхны элсэгчдээ баталж, уг тушаалд мэргэжилтэн багш, сургалт хүмүүжил эрхэлсэн захирал С.А.Кудряшовын хамт гарын үсэг зуржээ.\n\nАнатомич, доцент В.Н.Топольскийн удирдлагатайгаар, 7 тэнхим бүхий Хүн эмнэлгийн факультет зохион байгуулагдаж, 34 оюутантайгаар үйл ажиллагаагаа эхлүүлснээр Эрүүл Мэндийн Шинжлэх Ухааны Их Сургуулийн суурь тавигдсан юм.\n',NULL,'Хамтран зохион байгуулагч','2020-10-30 23:14:44','2020-10-30 23:33:55',229,NULL,'Зохион байгуулагч'),(124,'Мэнд Эвэнт',NULL,'Манай байгууллага нь доорх төслүүдийг амжилттай хэрэгжүүлж байна. \n\nMendevent app: Эрүүл мэндийн салбарт болж буй аливаа үйл ажиллагаа, хурал, зөвлөгөөнийг цаасгүй цахим хэлбэрт шилжүүлэн орчин үеийн дэвшилтэд технологийг ашиглаж хүний оролцоог багасгаж, хэрэглэхэд хялбар шийдлийг тусгасан ухаалаг утасны апплейкшин юм. Та бүхий л арга хэмжээ, үйл ажиллагааг чанарын өндөр түвшинд хийх хүсэлтэй байвал бидэнтэй холбогдоорой. \n\nPubmend.mn: Энэхүү платформ нь эрүүл мэнд, анагаахын салбарын эрдэмтэн, судлаач, багш, эмч, мэргэжилтнүүдийн оюуны бүтээлүүдийг хамгаалах, хадгалах, үнэлэх, түгээн дэлгэрүүлэх зорилготойгоор үйл ажиллагаа явуулдаг бүтээлийн нэгдсэн сан юм. Та энэхүү бүтээлийн нэгдсэн сангаас өөрт шаардлагатай бүтээлүүдээ уншиж, судлах мөн хэрэгцээт мэдээ, мэдээллээ авах, мэдлэгийн хүрээгээ тэлэх боломжтой. \n\nEdu.mend.mn: Энэхүү платформ нь эрүүл мэнд, анагаахын салбарын эмч, мэргэжилтнүүдийн багц цагийн биелэлтийг хангах, мөн хувь хүний хөгжилд нэмэр болох цахим сургалтын цогц сан юм. Та манай платформоос мэдлэг, ур чадварыг дээшлүүлэхээс гадна сонирхсон чиглэлээрээ өөрийгөө хөгжүүлэх боломжтой болж байна. ',NULL,'Ивээн тэтгэч','2020-10-30 23:16:08','2020-10-30 23:31:55',229,NULL,'Алтан ивээн тэтгэгч');
