INSERT INTO `events` VALUES (214,'3rd International Annual Meeting of Mongolian Society of Plastic and Reconstructive Surgeons (MSPRS)','2019-09-07 00:00:00','2019-09-08 05:00:00','   Монголын нөхөн сэргээх гоо сайхны мэс засалчдын нийгэмлэгийн Гутгаар уулзалт  нь Монгол улс, Улаанбаатар хот,Чингис Хаан зочид буудалд 2019 оны 9 дүгээр сарын 07, 08 ны өдрүүдэд зохион байгуулагдах гэж байгаа бөгөөд энэхүү чуулганыг “Мэнд.мн” аппликэйшн болон “Хэйлт Маркетинг Сервисэс” ХХК -уудтай хамтран мэргэжлийн өндөр төвшинд зохион байгуулах гэж байна. Гоо сайхны мэс засал нь Монгол улсад харьцангуй шинэ салбар бөгөөд шинэ технологи, шинэ арга барил, шинэ эмчилгээний арга өдрөөс өдөрт нээгдэн хурдацтай хөгжиж буй салбар билээ. \n\n   Энэхүү уулзалт нь Гоо сайхны мэс заслын салбар дахь цоо шинэ нээлт, бүтээлүүдийн танилцуулга бүхий таны мэдлэгийн цар хүрээг нээж өгсөн үр дүнтэй сургалт болно гэдэгт бид эргэлзэхгүй байна. Энэ удаагийн хурал дээр Хятад, Тайван, Солонгос, Вьетнам, Португали, Сингапур, Таиландын профессорууд хүрэлцэн ирж илтгэл хэлэлцүүлэх бөгөөд та бүхний танилын хүрээгээ мэдлэгийн хүрээтэйгээ хамт нэмэгдүүлэх бас нэгэн боломж гэж бид үзэж байна.','2019-08-15 19:29:29','2020-10-27 00:14:07',1,'Чингис зочид буудал','Tokyo St 10, Ulaanbaatar 13381',0,NULL,0,NULL),(215,'Монголын Дүрс Оношилгооны Эмч нарын Үндэсний Чуулган 2019','2020-12-01 11:00:00','2020-12-01 11:00:00','    Монголын Дүрс Оношилгооны Эмч Нарын Үндэсний Чуулган - 2019-д манай улсын Төв Эмнэлгүүд, нийслэлийн 9 дүүрэг, 21 аймгийн нэгдсэн эмнэлэг, Хувийн хэвшлийн Интермед, Грандмед, Сонгдо, Мөнгөнгүүр, Медипас, Медтравма, Люксмед, Бриллианс клиник болон бусад улсын хэмжээнд дүрс оношилгооны томоохон төв бүхий эмнэлгүүдийн дүрс оношлогооны мэргэжлийн 450 гаруй эмч, техникч, мэргэжилтнүүд оролцон дүрс оношилгооны орчин үеийн дэвшилтэт технологи, энэ чиглэлд хийгдэж буй эрдэм шинжилгээний бүтээлүүдийг танилцуулж, эмнэлзүйн лекц, ховор, сонирхолтой тохиолдлуудыг хэлэлцэнэ.\n    Мөн энэ удаагийн чуулганаа “Мэнд.мн” аппликэйшн болон “Хэйлт Маркетинг Сервисэс” ХХК -уудтай хамтран “Digital Transformation” буюу “Дижитал шилжилт” нэртэйгээр техник, технологийн дэвшлийг ашиглаж мэргэжлийн өндөр төвшинд бүрэн дижиталжсан, цаасгүй хурал хэлбэрээр зохион байгуулж эрүүл мэндийн салбарт хурал зохион байгуулалтын  цоо шинэ соёлыг бий болгохоор төлөвлөн ажиллаж байгаа тул  танай байгууллагын Дүрс оношилгооны мэргэжлийн эмч, эмнэлгийн мэргэжилтнүүдийг өргөнөөр оролцохыг урьж байна. ','2019-08-15 19:34:36','2020-10-27 00:13:17',3,'Чингис зочид буудал',NULL,0,NULL,0,NULL),(220,'Өрхийн анагаах ухааны хөгжил-20 жил','2019-09-18 12:00:00','2019-09-18 13:00:00','МӨАУМХ нь Дэлхийн өрхийн эмч нарын нийгэмлэг WONCA-н гишүүн байгууллага бөгөөд Дэлхийн, бүсийн хурал зөвлөгөөнд идэвхтэй оролцож байна. Бид Өрхийн анагаах ухаан сэтгүүлийг эрхлэн гаргаад 20  жил болж байна. \nӨнөөдрийн байдлаар нийт 215 өрхийн эрүүл мэндийн төвд эмч 960, сувилагч, тусгай мэргэжилтнүүд-927, бусад ажилчид 694 нийт 2581 эмч, ажилчид  монгол улсын 2.4 сая буюу хүн амын 70 хувьд эрүүл мэндийн анхан шатны  болон нийгмийн эрүүл мэндийн тусламж үйлчилгээг үзүүлж байна. \nСүүлийн жилүүдэд өрхийн эрүүл мэндийн төвийн баримтлах хууль дүрэм журмууд шинэчлэгдэн ажиллаж,  ДЭМБ-ын нэг ч хүнийг орхигдуулахгүй эрүүл мэндийн тусламжинд хамруулах“, “Бүх нийтийн эрүүл мэндийн хамралт- Эрүүл мэндийн анхан шатны тусламж, үйлчилгээг” онцлох төдийгүй өрхийн тусламж үйлчилгээнд технологийн шинэчлэл болох мобайл технологийг хэрэгжүүлж байгаа нь эрүүл мэндийн анхан шатны тусламжийн хөгжлийг харуулж байна.  Эрүүл мэндийн салбарын тогтолцооны  шинэчлэлийн чухал хэсэг болох өрхийн анагаах ухааны шинэ тогтолцоо, өрхийн эрүүл мэндийн төвийн үүсэж хөгжсөний түүхт 20 жилийн ойг тэмдэглэн  түүхчлэн үлдээх, өрхийн эмнэлэгт ажиллаж ажил амьдралынхаа гарааг эхэлсэн, олон жил үр бүтээлтэй ажилласан эмч мэргэжилтнүүдийн хөдөлмөр зүтгэлийг үнэлэх, ололт амжилтыг сурталчилан, хөгжлийн дараагийн гарцыг тодорхойлох зорилготой үохион байгуулж байна.\n','2019-09-10 21:51:19','2020-10-27 00:13:29',NULL,'Corporate Convention Center','Corporate Convention Center',0,NULL,0,NULL),(221,'Эх нярайн эрүүл мэнд - Хамтын хөгжил Олон улсын эрдэм шинжилгээний  бага хурал   ','2019-10-16 00:00:00','2019-10-16 08:00:00','Нийслэлийн Хүрээ амаржих газрын 60 жилийн ой Монголын эх барих эмэгтэйчүүдийн эмч нарын холбооны 30 жилийн ойг тохиолдуулан хамтран зохион байгуулж буй  олон улсын онол практикийн бага хурал юм. ','2019-10-09 23:38:10','2020-10-27 00:27:12',NULL,'Чингис Зочид буудал \"Khan Ballroom\"',NULL,1,NULL,0,NULL),(222,'DraftEvent','2019-11-12 16:00:00','2019-11-15 16:00:00','Run-as allows you to execute commands in the shell with the same permissions owned by the app. It checks whether the user calling it is either root or using adb so you need to enable USB or WiFi adb debugging access on your device first.','2019-10-22 20:05:42','2019-11-06 19:06:55',NULL,'Chingis hotel',NULL,0,NULL,1,NULL),(223,'Пневмокониозын дүрс оношилгоо ба ялган оношилгоо','2019-11-08 00:00:00','2019-11-09 09:00:00','ШУГТЭ-ийн Монгол Улсын Төрийн соёрхолт,\nАрдын эмч, Хүндэт профессор Р.Пүрэвийн\nнэрэмжит Дүрс оношилгооны лавлагаа төв\nбайгуулагдсаны 9 жилийн ойд зориулсан Пневмокониозын дүрс оношилгоо ба ялган оношилгоо сэдэвт 2 багц цагийн сургалт. \n\nЗохион байгуулагч:\nШУГТЭ “Гэрлийн Пүрэв” сан\nМонгол Улсын Төрийн соёрхолт, Ардын эмч\nХүндэт профессор Рэнцэнгийн Пүрэвийн нэрэмжит\nДүрс оношилгоооны лавлагаа төвийн\nДүрс оношилгооны тасаг\nАкадемич Т.Шагдарсүрэнгийн нэрэмжит\nАнагаах ухааны хүрээлэн','2019-11-06 19:00:13','2020-10-27 00:14:54',NULL,'ШУГТЭ Хурлын Заал',NULL,1,NULL,0,NULL),(224,'Фитнессийн спортын нотолгоонд суурилсан зөвлөгөө мэдээлэл авах эвэнт','2020-10-01 11:00:00','2020-10-01 12:30:00','Фитнессийн спортоор анхлан хичээллэгсдийн дунд тулгардаг түгээмэл бэрхшээлүүдийн нэг бол мэдлэг, мэдээлэл байдаг. Хэдийгээр бид мэдээллийн зуунд амьдарч байгаа ч хэтэрхий их дата дунд хөвж яваа бөгөөд, үнэн эсвэл худал гэдгийг нь ялгахад тун бэрх байдаг билээ. Фитнессийн багш нарын онолын мэдлэг хангалтгүй, монгол хэл дээр мэдээ мэдээлэл хомс байгаа энэ үед нотолгоонд суурилсан зөвлөгөө мэдээллийн үнэ цэн асар их байгаа билээ. ','2020-07-01 00:44:08','2020-10-27 00:12:44',NULL,'Nomad Coffee shop',NULL,1,NULL,1,NULL),(225,'Event Name','2020-09-01 00:00:00','2020-08-08 12:00:00','Event general information','2020-08-26 07:33:27','2020-10-27 00:09:01',NULL,'Ulaanbaatar hotiin haa negtee','',0,NULL,1,NULL),(226,'Туршилт эвэнт 123','2020-09-30 19:00:00','2020-10-01 23:00:00','ТУршилт- 123','2020-09-28 20:56:19','2020-10-27 00:09:09',NULL,'Туршилт байрлал',NULL,1,NULL,1,NULL),(227,'Цэвэршилтийн насны эрүүл мэнд','2020-10-23 01:00:00','2020-10-24 08:30:00','\"Цэвэршилтийн насны эрүүл мэнд\" эрдэм шинжилгээ онол практикийн бага хурал','2020-10-11 19:26:09','2020-11-02 12:55:10',NULL,'Төрийн тусгай албан хаагчдын нэгдсэн эмнэлэг',NULL,NULL,NULL,0,'907d5cf8919e1381d292038cbe2f544f'),(228,'asdf','2020-10-27 07:50:02','2020-10-27 07:50:02','sdfasfasdf','2020-10-26 23:59:47','2020-10-26 23:59:47',NULL,'asdfasdf',NULL,NULL,NULL,1,NULL),(229,'ХЭТ АВИАН ОНОШИЛГООНЫ ОЛОН УЛСЫН  УДИРДАМЖ ТАНИЛЦУУЛАХ СУРГАЛТ','2020-11-14 00:00:00','2020-11-14 09:30:00','МОНГОЛЫН ЭХ БАРИХ ЭМЭГТЭЙЧҮҮДИЙН ХЭТ АВИАН ОНОШИЛГООНЫ ҮНДЭСНИЙ НИЙГЭМЛЭГЭЭС ЗОХИОН БАЙГУУЛАГДАХ \nХЭТ АВИАН ОНОШИЛГООНЫ ОЛОН УЛСЫН \nУДИРДАМЖ ТАНИЛЦУУЛАХ СУРГАЛТ  \nСургалтын төлбөр: 150000 төг\nДанс: 5431212657\nХүний тоо хязгаартай\n','2020-10-27 00:01:25','2020-10-30 23:18:44',NULL,'Corporate Hotel',NULL,NULL,NULL,0,NULL);
