INSERT INTO `eventspeakers` VALUES (2,'Ц. Эрдэмбилэг','МХАОНийгэмлэгийн УЗГ, АШУҮИС ДОТэнхимийн эрхлэгч, АУ Доктор, Дэд профессор',1,NULL,'2019-07-30 03:45:18','2019-09-09 20:09:10',10,NULL,NULL,NULL,NULL),(3,'Д. Бархүү','Дүрс оношлогооны  тэргүүлэх зэргийн эмч, Клиникийн профессор,\n\nБоловсрол\n- 1997 > Анагаах ухааны их сургуулийг төгссөн, Анагаах ухааны магистр\n\nАжлын Туршлага\n- 2001-2014 > ГССҮТөв эмнэлэгт дүрс оношилгооны  эмч, тасгийн эрхлэгч, \n- 2012-2013 > ЭМШУИС-н Эрүүл Мэндийн Технологийн Сургуулийн Дүрс оношилгооны тэнхимийн эрхлэгч,  \n- 2014 > Мөнгөнгүүр эмнэлгийн захиралаар, \n- 2016 > Монсан Медикал Сервис ХХК-ний гүйцэтгэх захирал,\n- 2018 > Медтравма эмнэлгийн захиралаар тус тус ажиллаж байна.',1,NULL,'2019-07-30 04:06:44','2019-09-11 03:04:38',9,215,'Монголын Яаралтай Тусламжийн Радиологийн Нийгэмлэгийн Ерөнхийлөгч','1#Doctor',NULL),(4,'Д.Гончигсүрэн','“ГрандМед” эмнэлгийн захирал, АУ-ны доктор ',1,NULL,'2019-07-30 04:08:20','2019-09-10 02:10:08',13,NULL,NULL,NULL,NULL),(5,'П.Төгсжаргал','МХАОНийгэмлэгийн УЗГ , АШУҮИС ДОТэнхимийн ахлах багш, АУ Магистр',1,NULL,'2019-07-30 04:11:11','2019-09-11 06:04:00',15,NULL,NULL,NULL,NULL),(7,'Б.Эрдэнэбулган','Улсын хоёрдугаар төв эмнэлгийн стратеги, төлөвлөлт эрхэлсэн дэд захирал, Хөхний эрүүл мэндийн төв төслийн удирдагч, анагаах ухааны доктор',0,NULL,'2019-07-30 04:24:29','2019-09-12 02:03:23',NULL,NULL,NULL,NULL,NULL),(8,'Т.Адъяатөмөр','- “Монголын Эрүүл Мэндийн Хөгжил Шинэчлэл Холбоо” Үүсгэн байгуулагч, тэргүүн\n- “Монголын Эрүүл Мэндийн Салбарынханы Нэгдсэн Групп” Үүсгэн байгуулагч\n- “Индранил Дентал Групп” Үүсгэн байгуулагч, Ерөнхий захирал \n- \"Health Marketing Services\" Үүсгэн байгуулагч   \n- \"Hygiene Consulting Services\" Хамтран үүсгэн байгуулагч  \n- Дотрын их эмч \n\nАжил: \n- ЭМЯ Эрүүл мэндийн дэд сайдын нарийн бичиг, туслах 2013-2014\n- УНТЭ мэргэжилтэн, дотрын резидент эмч 2013-2015\n- MедМонгол ХХК  - борлуулалтын менежер, диабетийн мэргэжилтэн 2010-2013\n',1,NULL,'2019-07-30 04:35:05','2019-09-16 20:41:27',NULL,215,'Mendmn - Үүсгэн байгуулагч, ТУЗ-ын дарга, энтрепренер \n',NULL,NULL),(9,'Ц. Гантөмөр','АУ-ны доктор \n',1,NULL,'2019-08-20 00:01:15','2019-09-11 03:04:12',NULL,214,'Монголын Нөхөн Сэргээх Гоо Сайхны Мэс Засалчдын Нийгэмлэгийн Ерөнхийлөгч','1#Doctor',NULL),(10,'Н. Оюун','АУ-ны доктор, Перфект клиник эмнэлгийн захирал',1,NULL,'2019-08-20 00:04:12','2019-09-06 06:05:55',NULL,214,'АУ-ны доктор, Перфект клиник эмнэлгийн захирал',NULL,NULL),(11,'Ж.Эрдэнэцогт','АУ-ны доктор, Эх Хүүхдийн Эрүүл Мэндийн Үндэсний Төв',1,NULL,'2019-08-20 00:04:36','2019-09-06 06:12:36',NULL,214,'АУ-ны доктор, Эх Хүүхдийн Эрүүл Мэндийн Үндэсний Төв',NULL,NULL),(12,'Su Ben Tsao','Prof, Immediate Former President of TSAPS (Taiwan)\n- Founding and Active Member of Oriental Society of Aesthetic Plastic Surgery. (OSAPS)\n- Active Member of International Society of Aesthetic Plastic Surgery. (ISAPS)\n- International Member of American Society of Plastic Surgeons. (ASPS)\n- International Corresponding Participant of American Society of Aesthetic Plastic Surgery. (ASAPS)\n- Founding and Director of Taiwan Society of Aesthetic Plastic Surgery.(TSAPS)\n- Director of Taiwan Society of Plastic Surgery(TSPS)\n- Founder and President, Southern Taiwan Aesthetic Medicine Forum\n- Best resident doctor during 1983-1984, and 1984-1985\n- Chang Gung Memorial Hospital at Taipei, Taiwan\n- First and second President of Physician’s Association of Chang Gung Memorial Hospital at Kaohsiung during 1997-2001\n- Founder of Kaohsiung Cleft Palate and Craniofacial Association in 1994\n- Founder and President of Kaohsiung Aesthetic Medical Tourism Promotion Association, since 2008\n- Municipal advisor of Kaohsiung City Government & Presbyter of Presbyterian Church',1,NULL,'2019-08-20 00:38:36','2019-09-05 20:55:10',NULL,214,'Founding Director of Asian Plastic Craniofacial Association.',NULL,NULL),(13,'Adrian Ooi Seng Huan','Dr,  Honorary Secretary of SAPS,  (Singapore)\n- MBBS (London)\n- MMe