and Head and Neck Surgery and\nbecame Specialist in 1997.\n-  Special interest in Facial Plastic Surgery and, particularly, in functional and aesthetic rhinoplasty. He has spent time in Amsterdam,\nToronto and Indianapolis working with leading international facial plastic surgeons learning various aspects of reconstructive and aesthetic facial plastic procedures. Currently he has a busy practice in Porto as well as in Lisbon, mainly focused in aesthetic as well as functional rhinoplasty.\n- Frequently invited to lecture in Congresses in Europe, America and Asia. He is author of several scientific papers published in medical journals\nand of several book chapters about rhinoplasty published in Europe and USA.\n-  Reviewer for the Aesthetic Plastic Surgery Journal, for the American Journal of Rhinology and Alergy and for the Laryngoscope Journal.\n-  Member of the European Academy of Facial Plastic Surgery and of the Asian Facial Plastic Surgery Society. He is National Delegate for\nPortugal of the European Academy of Facial Plastic Surgery.',1,NULL,'2019-08-20 00:45:47','2019-09-05 20:54:21',NULL,214,'Director of the rhinoplasty course held in Porto\n“RinoArrabida”.',NULL,NULL),(22,'Л.Бямбасүрэн','Профессор, Улсын Нэгдүгээр Эмнэлэг',1,NULL,'2019-08-20 00:48:35','2019-09-06 06:16:59',NULL,214,'Профессор, Улсын Нэгдүгээр Эмнэлэг',NULL,NULL),(23,'Yu-Hsun Tony Chiu','Dr, Shin Kong Wu Ho-Su Memorial Hospital,  MD MMS (Taiwan)',0,NULL,'2019-08-20 00:49:26','2019-08-29 06:25:45',NULL,214,NULL,NULL,NULL),(24,'Ryu, Min-Hee','Dr, The Affiliated Friendship Plastic Surgery Hospital of Nanjing Medical University (Korea)\n- Korean Board Certified Plastic Surgeon and working at both Beijing and Seoul.\n-  I am very interested in facial rejuvenation surgeries such as facelift, perioculoplasty, and fat graft etc. I have a dream to contribute to develop Asian facial rejuvenation surgery.\n- The Affiliated Friendship Plastic Surgery Hospital of Nanjing Medical University - Plastic Surg