оваскулярная хирургия” ¹ 48 тоот үнэмлэх\n- 2002 онд ОХУ-н Москва хотын А.Н.Бакулевын нэрэмжит Зүрх судасны мэс заслын мэргэжил  дээшлүүлэх   курс\n- 2006, 2014 онд Парис хотын Авлам-Санте Кардио нийгэмлэгт 14 хоног титэм судасны ангиографийн, оношилгоо-эмчилгэний дээшлүүлэх сургалт\n- 2014 онд  Унгар улсын Peich   хотод ренальденервешины сургалт\n\n1993 оноос хойш П.Н.Шастины нэрэмжит Клиникийн төв эмнэлгийн зүрх судасны мэс заслын тасаг, рентген оношилгооны тасаг, ангиографийн оношилгоо-эмчилгээний тасагт тасралтгүй ажиллаж улмаар ангиологийн эмчийн нарийн мэргэжлийг эзэмшин, ангиографийн шинжилгээг эмчилгээний түвшинд Монгол улсын хэмжээнд практикт анх нэвтрүүлж судсан дотуурх мэс заслын аргаар элэгний хавдар, дэлүү, бөөрний судсыг бөглөх эмчилгээ анхлан хийсэн.\n\n1997 онд ОХУ-н Томск хотод ангиографийн курс, 2000 онд ОХУ-н Кемеровын мед/ академид ангиографийн дээшлүүлэх курст суралцаж “Ангиология и эндоваскулярная хирургия” ¹ 48 тоот үнэмлэхийг манай улсаас анх удаа авч ирсэнээр өөрийн оронд судсан дотуурх мэс заслын эмчилгээг хийж, хөгжүүлэн нэвтрүүлэх анхны нь алхам болсон байна.  Мөн Франц, Япон, Солонгос, Люксенбург, Америкийн зүрхний эмч нартай хамтран, Монголд зүрхний титэм судасны эмгэг, зүрхний таславчийн төрөлхийн гажиг, хавхлагын гажгуудыг судсан дотуурх мэс заслын аргаар эмчлэн, хөгжүүлэхэд анхдагч нь болсон.\n\nЭмнэлгийн практикт элэгний хавдар, бөөр, дэлүү, умайн судсыг бөглөх эмчилгээ, титэм судас, бөөрний болон захын судасны нарийслыг тэлж, стент тавих эмчилгээг ангиографийн аргаар хийж, манай улсын анагаах ухааны түүхэнд үнэтэй хувь нэмэр оруулсны, зэрэгцээ хамтын бүтээл ном-11, дууссан ажлын тайлан-2, эрдэм шинжилгээний өгүүлэл-53, илтгэл-79 бичиж нийтлүүлсний 8 өгүүлэл гадаадын хэвлэлд нийтлэгдсэн байна. \n',1,NULL,'2019-09-06 03:00:31','2019-09-11 23:55:39',NULL,215,'АУ-ны доктор, профессор','1#Doctors',NULL),(120,'П. Төгсжаргал ','- Монголын Хөхний Дүрс Оношилгооны нийгэмлэгийн ерөнхийлөгч  \n- АУ-ны магистр, клиникийн профессор\n- АШУҮИС Ра