20,'Нэгдсэн үндэстний байгууллагын Хүн амын сангийн Монгол дахь Суурин төлөөлөгч','5#Хүндэт илтгэгчид',NULL),(163,'Л. Бямбасүрэн','Эрүүл мэндийн дэд сайд',0,NULL,'2019-09-16 03:13:14','2019-09-17 02:34:13',NULL,220,'Эрүүл мэндийн дэд сайд','5#Хүндэт илтгэгчид',NULL),(164,'С. Сонин','Боловсрол\n- 1974 онд Улаанбаатарын 10 жилийн Лаборатори 1 дүгээр дунд сургууль, \n- 1981 онд ЗХУ-ын (хуучин нэрээр) Эрхүү хотын Анагаах ухааны дээд сургуулийн Эмчилгээний ангийг мэс заслын чиглэлээр  тус тус төгссөн.\n- 1990 оны 9 сарын 20-нд АУДС-ийн Эрдмийн зөвлөлд “Элэгний уйланхайт өвчний эхографийн оношилгоо” сэдвээр анагаах ухааны докторын зэргийг хамгаалсан.\n- 1995 онд “Дэд профессор” цол, \n- 2008 онд “Профессор” цол тус тус хүртсэн.\n\n\nАжлын Туршлага\n- 1981 оны 7 сарын 1-нээс Анагаах ухааны дээд сургуулийн Судалгааны мэс заслын тэнхимд академич Т.Шагдарсүрэнгийн удирдлаганд ажиллан ажил хөдөлмөрийнхөө гарааг эхэлсэн.\n- 1984 – 1987 онд АУДС-ийн Ерөнхий мэс засал, Мэс заслын арга барил, топограф анатомийн тэнхимд Гавъяат багш, профессор П.Долгор, Ардын эмч, профессор Б.Гоош нарын удирдлаган дор ажилласан. \n- 1987 – 1989 онд УКТЭ-ийн Цөмийн онош зүйн тасагт эхо оношилгооны эмчээр, \n- 1990 – 1992 онд УКТЭ-ийн Эхо оношилгооны тасгийн эрхлэгчээр, \n- 1992 - 1996 онд Улсын клиникийн төв эмнэлгийн Эмчилгээ эрхэлсэн дэд захирал, АУДС-ийн Дүрс оношилгооны тэнхимийн багшаар,   \n- 1997  оноос 2007 оны 6 дугаар сар хүртэл   Монгол улсын Засгийн газраас Азийн хөгжлийн банктай хамтран хэрэгжүүлсэн “Эрүүл мэндийн салбарын хөгжил-1, 2” хөтөлбөрийн гүйцэтгэх захирлаар, \n- 1999 оны 1 сараас 1999 оны 7 сар – Монгол улсын Засгийн газрын гишүүн, Эрүүл мэнд, нийгмийн хамгааллын сайдаар,\n- 1999 оны 8 сараас 2000 оны 8 сар - Монгол улсын Засгийн газрын гишүүн, Эрүүл мэнд, нийгмийн хамгааллын сайдаар,\n- 2007 – 2008 онд Улсын клиникийн төв эмнэлгийн дарга, Эрдмийн зөвлөлийн даргаар,  \n- 2009 - 2013 онд Монголын Мянганы сорилтын сангийн Эрүүл мэндийн төслийн зөвлөх багийн ахлагч, ахлах зөвлөхөөр, \n- 2014 – 2017 онд Монгол улсын Засгийн газраас Азийн хөгжлийн банктай хамтран хэрэгжүүлсэн Монгол улсын “Эрүүл мэндийн даатгалын тогтолцоог бэхжүүлэх нь” техник туслалцааны төслийн зохицуулагчаар тус тус ажилласан.\n\n',1,NULL,'2019-09-16 03:17:04','2019-09-17 02:37:02',NULL,220,'Монголын өрхийн анагаах ухааны мэргэжилтнүүдийн холбооны ерөнхийлөгч ','5#Хүндэт илтгэгчид',NULL),(165,'Д.Нарантуяа','Эрүүл мэндийн яамны Эдийн засаг, санхүүгийн хэлтсийн дарга ',0,NULL,'2019-09-16 03:26:03','2019-09-17 02:34:19',NULL,220,'Эрүүл мэндийн яамны Эдийн засаг, санхүүгийн хэлтсийн дарга ','5#Хүндэт илтгэгчид',NULL),(166,'Г. Дэлгэрцэцэг','- Сүхбаатар аймгийн \"Энэрэл өрхийн ЭМТ”, дүн бүртгэгч, бага эмч\nБоловсрол \n- ЭМШИУС сувилахуйн сургууль- 2006-2009 он, УБ хот',0,NULL,'2019-09-16 03:42:46','2019-09-17 00:21:58',NULL,220,'Бага эмч, сувилагч','1#Doctors',NULL),(167,'О. Одмандах','Өрхийн их эмч',0,NULL,'2019-09-16 04:15:36','2019-09-17 02:34:37',NULL,220,'Говьсүмбэр аймгийн “Энхтусдэм” өрхийн эрүүл мэндийн төвийн дарга','1#Doctors',NULL),(168,'Б. Жаргалсайхан','Баянзүрх дүүргийн “Евро-эм” өрхийн эрүүл мэндийн төвийн сувилагч ',0,NULL,'2019-09-16 04:15:53','2019-09-17 02:34:51',NULL,220,'Баянзүрх дүүргийн “Евро-эм” өрхийн эрүүл мэндийн төвийн сувилагч \n','3#Nurse',NULL),(169,'Д. Мягмарцэрэн','- 1992 онд АУДэС-ийг хүний их эмч мэргэжлээр төгссөн.\n- 1992-1999 он хүртэл Өрхийн эмчээр ажилласан. Өрхийн эмчийн резидентурын сургалтыг дүүргэж өрхийн эмчээр мэргэшсэн.\n- 2000 оноос одоог хүртэл Өрхийн Анагаах Ухааны тэнхимд\nдадлагажигч багш, багш, ахлах багш, тэнхмийн эрхлэгчээр\nажиллаж байна.\nБНСУ, Голланд, Герман, БНХАУ-д мэргэжил дээшлүүлсэн.\n- 2008 онд ’’Чихрийн шижин өвчний эрсдэлт хүчин зүйлсийн\nтархалтын судалгаа’’ сэдвээр АУ-ны докторын зэрэг\nхамгаалсан. \n- 2013 онд Дэд профессор цол хүртсэн.\n\nЭрдэм шинжилгээний өгүүлэл:\n- Дотоодод-48, гадаадад-8 хэвлүүлэн IF-2,4-3,7-той\nдэлхий нэр хүндтэй мэргэжлийн сэтгүүлд 4 өгүүлэл\nхэвлүүлсэн байна\n\nЭрдэм шинжилгээний илтгэл:\n- Дотоодод-52, гадаадад-12 нийтлүүлэн хэвлүүлсэн\nбайна.\n- АУ-ны 2 доктор, АУ, НЭМ-н 16 магистрын судалгааны ажлыг\nудирдан амжилттай хамгаалуулсан.\n- Доктор, магистрын эрдэм шинжилгээний 22 ажилд шүүмж\nхийсэн.\n- Улсын чанартай 20 гаруй төсөлт ажлуудад зөвлөх,\nсудлаачаар оролцож ажилласан.\n2005 оноос одоог хүртэл:\n- ЭМЯ-ны Ерөнхий мэргэжлийн салбар зөвлөлийн гишүүн\nнарийн бичгийн дарга\n- МӨАУМХ-ны ТУЗ-н гишүүн\n- Монголын Гипертензийн Холбооны ТУЗ гишүүн.\n',0,NULL,'2019-09-16 04:16:14','2019-09-17 00:52:34',NULL,220,'Анагаахын шинжлэх ухааны үндэсний их суургуулийн Өрхийн анагаах ухааны тэнхимын эрхлэгч','5#Хүндэт илтгэгчид',NULL),(170,'Б.Ганбат','Боловсрол \n- 1996 онд АУИС-ийн эмчилгээний ангийг хүний их эмчийн мэргэжлээр, \n- 1996 онд МУИС-ийн ОУХДС-ийг англи хэлний хэлмэрч мэргэжлээр,  \n- 1998 онд АУИС-д “Улаанбаатар хотын эмч нарын тасралтгүй сургалт, мэргэжлийн түвшинд өгсөн үнэлгээ” сэдвээр АУ-ны магистрын зэрэг, \n- 2002 онд АУИС-д “Эмч нарын мэргэжлийн тасралтгүй сургалтын өнөөгийн байдал хэтийн төлөвийн асуудалд” сэдвээр АУ-ны докторын зэрэг, \n- 2004 онд Австралийн Куртины Технологийн Их Сургуульд эрүүл мэндийн тусламж үйлчилгээний удирдлагын чиглэлээр магистрын зэрэг тус тус хамгаалсан.\n\nМэргэжил дээшлүүлсэн байдал\n- Австрали, Англи, АНУ, Австри, БНСУ, ХБНГУ, Унгар, Тайланд, Япон, БНХАУ, ОХУ, Филиппин, Тайвань, Шри-Ланка улсуудад өрхийн анагаах ухаан, нийгмийн эрүүл мэнд, менежмент, судалгааны арга зүй, анагаах ухааны боловсрол судлалын чиглэлээр мэргэжил дээшлүүлсэн \n\nГавьяа, Шагнал\n- ЭМЯ-ны жуух бичиг 2006\n- ШУА-ийн жуух бичиг	2007\n- Эрүүлийг хамгаалахын тэргүүний ажилтан цол тэмдэг 2014\n- Нийслэлийн 375 жилийн ойн медаль 2015\n-Нийслэл Улаанбаатар хотын тэргүүний ажилтан цол тэмдэг 2016\n',1,NULL,'2019-09-16 04:16:32','2019-09-17 19:47:59',NULL,220,'ДЭМБ-ын Монгол дахь суурин төлөөлөгчийн газарт мэргэжилтэн','5#Хүндэт илтгэгчид',NULL),(171,'Т. Адъяатөмөр','- “Монголын Эрүүл Мэндийн Хөгжил Шинэчлэл Холбоо” Үүсгэн байгуулагч, 