 ҮСХ-ны ХАНСГ-ын Хүн ам, орон сууцны тооллогын товчооны дарга\n2017.11 – одоо хүртэл Үндэсний статистикийн хорооны Хүн ам, нийгмийн статистикийн газрын дарга\n\n\n\n\n\n\n',1,NULL,'2020-10-22 07:24:59','2020-10-22 07:24:59',NULL,227,'Үндэсний статистикийн хорооны Хүн ам, нийгмийн статистикийн газрын дарга,Эдийн засагч, хүн ам зүйч, Хүн ам зүйн доктор',NULL,NULL),(266,' Б.ЦЭДМАА','Боловсролын байдал: \n- 1993 онд Москвагийн Анагаах ухааны их сургууль төгссөн\n- 2001 онд Сингапурын Их сургуульд “Reproductive endocrynology” сэдвээр шинжлэх ухааны магистрын зэрэг хамгаалсан\n- 1994 оноос ЭХЭМҮТ-ийн Эх барих эмэгтэйчүүдийн эмнэлэгт их эмч, зөвлөх эмчээр\n- 2007 онооос НҮБХАС-д “Эх нярайн тусламжид зайн оношилгооны дэмжлэг үзүүлэх” төслийн зохицуулагчаар\n- 2017 оноос Монголын эх барих эмэгтэйчүүдийн эмч нарын холбооны тэргүүнээр ажиллаж байна',1,NULL,'2020-10-22 07:30:07','2020-10-22 07:30:07',NULL,227,'МЭБЭЭНХ-ний Тэргүүн, Эх барих эмэгтэйчүүдийн Тэргүүлэх зэргийн эмч, Клиникийн профессор',NULL,NULL),(267,'Чойжилжав МӨНХБАЯР ','Боловсролын байдал: \n1993 он - Хүний их эмч, (Моногол Улсын Улаанбаатар хотын АУ-ны Их Сургууль)\n1993 -1995 он - Анагаах Ухааны Магистр (Моногол Улсын АУ-ны Их Сургууль Эх барих эмэгтэйчүүд Судлалын Тэнхим) \n1998 – он одоог хүртэл - Докторант (АШУҮИС-ийн ЭБЭС- ын тэнхим)\nЦол: \n2016 - Клиникийн Профессор (ЭХЭМҮТ)\nАжилласан байдал: \n1995-1998 Эх барих, эмэгтэйчүүдийн эмч, КНАГ\n1998-2000 Эрдэм шинжилгээний ажилтан, АУХүрээлэн\n2001- 2006 Архангай аймгийн Өндөр-Улаан сумын эмч, Аймгийн НЭ- ийн эх барих эмэгтэйчүүдийн эмч\n2007- 2012  ЭХЭМҮТ- ийн эх барих эмэгтэйчүүдийн эмч, \n2013 оноос одоог хүртэл ЭХЭМҮТ-ийн ЭБЭ-ийн Эмэгтэйчүүдийн эмгэг судлалын тасгийн эрхлэгч эмч\nМэргэжлийн нийгэмлэгийн гишүүнчлэл, хамтын ажиллагаа:\nМонгол  Эх барих Эмэгтэйчүүдийн Эмч нарын Холбоо\nМонголын Эмэгтэйчүүдийн Мэс засалч Эмч нарын Нийгэмлэг\nМонголын Эмэгтэйчүүдийн Хавдар Судлаач эмч нарын Нийгэмлэг\nМонголын Кольпоскопийн Нийгэмлэг\n',1,NULL,'2020-10-22 07:37:59','2020-10-22 07:37:59',NULL,227,'ЭХЭМҮТ-ийн ЭБЭ-ийн Эмэгтэйчүүдийн эмгэг судлалын тасгийн эрхлэгч эмч, Клиникийн Профессор ',NULL,NULL),(268,'Д. СҮХЭЭ','Боловсролын байдал: \n1969 онд Анагаах ухааны их сургууль төгссөн\n1969-1978 онд УБ хотын II амаржих газарт Эх барих эмэгтэйчүүдийн эмч\n1979-1986 онд Эх нялхасын эрдэм шинжилгээний хүрээлэн (ЭНЭШХ)-д эрдэм шинжилгээний ажилтан\n1987-1990 онд Москва хотын 51-р эмнэлэгт Эмэгтэйчүүдийн эмч\n1991-1996 онд Эмнэлгийн ажилтны мэргэжил дээшлүүлэх институтэд эрдэм шинжилгээний ажилтан \n1997-2010 онд АУИС, Эх барих эмэгтэйчүүдийн тэнхимд багш\n1991-2012 Эх Хүүхдий Эрүүл Мэндийн Үндэний Төв (ЭХЭМҮТ)-ийн Эх барих эмэгтэйчүүдийн эмнэлэгт зөвлөх эмч\n2013-2020 Нийслэлийн Өргөө амаржих газарт зөвлөх эмчээр тус тус ажиллаж байна.',1,NULL,'2020-10-22 07:42:27','2020-10-22 07:42:27',NULL,227,'Монгол улсын хүний гавъяат эмч',NULL,NULL),(269,'Ж. БУЯНЖАРГАЛ','Боловсролын байдал: \n1991 онд Анагаах ухааны их сургууль төгссөн\n1998 онд Анагаах ухааны магистр\n1995-2012 ЭХЭМҮТ-д их эмч, эмэгтэйчүүдийн эмгэг судлалын тасгийн эрхлэгч\n2007 оноос “Эвт хүч” эмэгтэйчүүдийн дотоод шүүрлийн эмнэлгийн захирал\n2013-2016 онд Монголын цэвэршилтийн нийгэмлэгийн гүйцэтгэх захирал',1,NULL,'2020-10-22 07:44:33','2020-10-22 07:44:33',NULL,227,'Эх барих эмэгтэйчүүдийн Тэргүүлэх зэргийн эмч, Клиникийн профессор ',NULL,NULL),(270,'Бямбасүрэн МЯГМАРДАГВА ','Боловсролын байдал: \n- 2010 он – Бизнесийн удирдлагын бакалавр, (ШУТИС-КТМС),\n- 2014 он – Нийгмийн удирдлагын магистр (Удирдлагын Академи) \n- 2015 он – Нийгмийн эрүүл мэндийн докторант (АШУҮИС-НЭМС) \n- 2016 он – Сэтгэл судлалын магистрант (МУИС-ШУС)\nАжилласан байдал: \n- 2010-2013 GO HELP Олон улсын хүмүүнлэгийн байгууллага, Төслийн зохицуулагч\n- 2013-2016 Тогтуун Хорвоо сэтгүүл, Редактор\n- 2013- ММАЗ Нийгэмлэг, Нарийн бичгийн дарга \nМэргэжлийн нийгэмлэгийн гишүүнчлэл, хамтын ажиллагаа:\n- European Menopause and Andropause Society (EMAS)\n- International Society for Sexual Medicine (ISSM)\n- Аsia Pacific Society for Sexual Medicine (APSSM)\n- Asia-Oceania Federation for Sexology\n',1,NULL,'2020-10-22 07:47:04','2020-10-22 07:47:04',NULL,227,'ММАЗ Нийгэмлэг, Нарийн бичгийн дарга, Нийгмийн удирдлагын магистр',NULL,NULL),(271,'Содномдорж ЭНХЭЭ','Боловсролын байдал: \n- 1988 он - Хүний их эмч, (ЗХУ-ын Эрхүү хотын АУ-ны Их Сургууль),\n- 1992 он - Анагаах Ухааны Магистр (ЗХУ-ын Эрхүү хотын АУ-ны Их Сургууль) \n- 1992 он - Эх барих эмэгтэйчүүдийн эмчийн мэргэшил олгох сургалт \n(АУ-ны Үндэсний Хүрээлэн), \n- 2002 он - Анагаах Ухаан, Эмнэлгийн Тусламж Үйлчилгээний Удирдлагын магистр \n(Их Британи)\n- 2018 он- Докторант (АШУҮИС)\nЦол: \n- 2018 - Клиникийн Профессор (АУ-ны Хүрээлэн)\nАжилласан байдал: \n- 1989-1998 Эх барих, эмэгтэйчүүдийн эмч, ЭХЭМҮТ\n- 2002-2008 Эрдэм шинжилгээний ажилтан, St. Thomas’s Hospital, Лондон, ИБУИНВУ\n- 2009-2014 Ерөнхий редактор, Тогтуун Хорвоо сэтгүүл\n- 2009- Тэргүүн, Монголын Менопауз Андропаузын Зохицуулалтын Нийгэмлэг ТББ\nМэргэжлийн нийгэмлэгийн гишүүнчлэл, хамтын ажиллагаа:\n- International Menopause Society (IMS)\n- Asia Pacific Menopause Federation (APMF)\n- European Menopause and Andropause Society (EMAS)\n- International Society for Sexual Medicine (ISSM)',1,NULL,'2020-10-22 07:52:58','2020-10-22 07:52:58',NULL,227,'Монголын Менопауз Андропаузын Зохицуулалтын Нийгэмлэг ТББ-ийн Тэргүүн, АУ-ны Магистр, Клиникийн Профессор',NULL,NULL),(272,'Найдангийн НАНСАЛМАА','Мэргэжлийн сургалт: \n- 1996 онд АУИС-ийг  төгссөн, Бөөрний  мэс заслын ахлах зэрэгтэйэмч. \n- 1996-1998 онд АУИС-ийн  ерөнхий болон бөөрний  мэс заслын  2 жилийн  мэргэжил олгох сургалтыг амжилттай биелүүлсэн.\n- БНХАУ-д 1999 онд бөөр шилжүүлэх мэс заслын бэлтгэл,  \n- АНУ-д  Чикаго хотод 2002 онд Бөөрний мэс засал, \nАвстриийн  Залцбургийн залуу урологи эмч нарын сургалтанд \n- 2000, 2008 онд бөөрний мэс заслын \n- Унгар улсад 2013 онд  Европын Бэлгийн Анагаах Ухааны Нийгэмлэгийн Охфордын сургалтан Сексологийн  богино хугацааны сургалтаар мэргэжил дээшлүүлэх курсуудад суралцсан. \nАжилласан байдал:\n- 1996-1998 онд АУИС-д  эрдэм шинжилгээний ажилтан,\n- 1998-2002  онд УКТЭ-ийн Бөөрний Мэс заслын Клиникт их  эмч, \n- 2000-2002 онд АУ-ны Үндэсний Хүрээлэнгийн “Бөөр Шилжүүлэн суулгах төсөл”-д эрдэм шинжилгээний ажилтан, \n - 2006 - 2010 онд Ачтан эмнэлэгт бөөрний мэс заслын эмч,   \n- 2010 оноос  хойш “АДАМ” эрэгтэйчүүд, бөөрний эмнэлэгт  эрэгтэйчүүд, бөөрний мэс  заслын эмчээр ажиллаж байна. \nБоловсролын байдал:\n- 1996-1998 онд  АУИС-ын  магистрантурт суралцаж УКТЭ-ийн  БМЗ-ийн тасгийн эрхлэгч Төрийн шагналт эмч Ж.Нарантуяагийн удирдлага дор  “Түрүү булчирхайн томролтын үеийн шээсний бактерлогийн эмэгэгийг хемилюнесценцийан аргаар тодорхойлох нь “ сэдвээр АУ магистр, \n- 2010-2014 онд  АУ-ны доктор, дэд профессор М.Намсрай, АУ-ны доктор, дэд профессор Ж.Мөнхцэцэг нарын удирдлага дор “Дөчөөс дээш насны  эрэгтэйчүүдийн шодойн хөвчрөл” сэдвээр анагаах ухааны докторын  зэрэг хамгаалсан.',1,NULL,'2020-10-22 07:58:34','2020-10-22 07:58:34',NULL,227,'\"АДАМ\" эмнэлгийн захирал, Монголын Бэлгийн Анагаах Ухааны Нийгэмлэгийн Тэргүүн, АУ\"ны доктор',NULL,NULL),(273,'Түмэнбаярын БАЯСГАЛАН  ','Боловсролын байдал: \n- 2004 он – Хүний их эмч, (Эрүүл Мэндийн Шинжлэх Ухааны Их Сургууль)\n- 2006 он – Дотрын эмч (Эрүүл Мэндийн Шинжлэх Ухааны Их Сургууль)\n- 2007 он – Дотоод шүүрлийн эмч (Эрүүл Мэндийн Шинжлэх Ухааны Их Сургууль) \n- 2008 он – Анагаах Ухааны Магистр (Эрүүл Мэндийн Шинжлэх Ухааны Их Сургууль) \n- 2012 он – Анагаах Ухааны Доктор (Жичи Анагаах Ухааны Их Сургууль, Япон улс)\nЦол: \n- 2020 – Дэд Профессор (Анагаахын Шинжлэх Ухааны Үндэсний Их Сургууль)\nАжилласан байдал: \n- 2004-2020 Дотоод шүүрэл судлалын тэнхимд дадлагажигч багш, багш, ахлах багш, тэнхмийн эрхлэгч;\n- 2006-2008 Улсын Нэгдүгээр Төв Эмнэлэгийн Дотрын 3-р тасагт гэрээт эмч; \n- 2012 Жичи АУИС-ийн Дотоод шүүрэл, бодисын солилцооны тэнхимд судлаач;\n- 2015 оноос Гурвангал нэгдсэн эмнэлгийн Дотоод шүүрлийн эмч; \n- 2020 оноос Queen’s Med Клиникийн Дотоод шүүрлийн зөвлөх эмч;\n- 2020 оноос АШУҮИС-ийн Мэргэжил Дээшлүүлэх Институтын захирал; \nМэргэжлийн нийгэмлэгийн гишүүнчлэл, хамтын ажиллагаа:\n- Монголын Залуу Эрдэмтдийн Холбооны удирдах зөвлөлийн гишүүн\n- Монголын Нейросаенсын Нийгэмлэгийн удирдах зөвлөлийн гишүүн   \n- Монголын Эндокринологчдын Нийгэмлэгийн нарийн бичгийн дарга \n- Монголын Диабетын Холбооны гишүүн \n- American Heart Association (AHA)\n- European Association for the Study of Diabetes (EASD)\n- Japan Endocrine Society (JES)\n- Asian Diabetes Society (ADS)\n',1,NULL,'2020-10-22 08:18:09','2020-10-22 08:18:09',NULL,227,'АШУҮИС-ийн Мэргэжил Дээшлүүлэх Институтын захирал, АУ-ны доктор, Дэд профессор',NULL,NULL),(274,'Ширчинжав АЛТАНТУЯА','Боловсролын байдал:\n- 2005 онд ЭМШУИС-ийг  Хүний их эмч мэргэжил эзэмшсэн \n- 2005-2007 онд ЭМШУИС-ийн Мэргэжил дээшлүүлэх Институтыг Эх барих эмэгтэйчүүдийн эмч\n- 2007-2009 онд ХБНГУ-ын Charite их сургуулийн Vivantes clinic Эх барих эмэгтэйчүүдийн мэргэжил дээшлүүлсэн.\n- 2013 онд АУ-ны МАГИСТР “Эрүүл жирэмсэн эхчүүдийн ургийн хүйн ба тархины дунд артерийн Допплер шинжилгээний хэвийн үзүүлэлтийг тогтоосон судалгаа” \n- 2013-2014 онд Swizerland Sant Gallen хотод “Ургийн зүрхний хэт авиан оношилгоо” мэргэжил дээшлүүлсэн. \n- 2017 онд Эх барих эмэгтэйчүүдийн АХЛАХ зэрэг \n- 2018 онд АУ-ны ДОКТОР “Жирэмсний эхний хугацаанд ургийн зүрхний том гажгийг илрүүлсэн судалгаа” \nАжлын туршлага:\n- 2008-2018 онд ЭХЭМҮТ-д Эх барих эмэгтэйчүүдийн эмч\n- 2019 оноос АШУҮИС-ийн Эх барих эмэгтэйчүүд судлалын тэнхимийн багш\n- 2019 оноос Монгол – Япон сургалтын эмнэлэгт Эх барих эмэгтэйчүүдийн эмч',1,NULL,'2020-10-22 08:26:21','2020-10-22 08:26:21',NULL,227,'Эх барих эмэгтэйчүүдийн Ахлах зэрэгтэй эмч, АШУҮИС-ийн ЭБЭСТ-ийн багш,  АУ-ны доктор',NULL,NULL),(275,'Т.Эрхэмбаатар ',' Боловсрол:\n1967 онд Нийслэлийн 10 жилийн 23-р дунд сургууль \n1967-1972 онд АУДС-ийн эмчилгээний ангийг төгссөн\n1972 онд Эх барих эмэгтэйчүүдийн мэргэжил олгох дамжаа \n1976-1977 онд Эх барих эмэгтэйчүүдийн дээд курс Клиник ординатур\n1980 онд ОХУ Иркутскийн Мэргэжил дээшлүүлэх институт 4 сар мэргэжил дээшлүүлэх \n1981 онд Эх барих эмэгтэйчүүдийн ахлах зэргийн эмч \n1986,1991 онд Эх барих эмэгтэйчүүдийн тэргүүлэх зэргийн эмч\nЭрхэлж буй (байсан) ажил: \n1972-1979 онд Сэлэнгэ аймгийн Нэгдсэн эмнэлэгт төрөх эмэгтэйчүүдийн тасгийн эмч, эрхлэгч\n1980-1983 онд Улаанбаатар хотын III-р амаржих газрын 2-р тасгийн эрхлэгч\n1983-1985 онд Анагаах Ухааны Дээд сургуулийн Эх барих эмэгтэйчүүд судлалын тэнхимд багш, III-р амаржих газрын зөвлөх эмч\n1985-1988 онд УБ хотын Клиникийн нэгдүгээр амаржих газрын дарга, ерөнхий эмч\n1988-1990 онд ЗХУ-ын Белоруссийн Минск хотын Эмч нарын мэргэжил дээшлүүлэх  институтийн аспирант\n1990-1992 онд Эмнэлгийн Ажилтны Мэргэжил Дээшлүүлэх Институтийн  (МДИ) эх барих эмэгтэйчүүд судлалын тэнхимийн эрхлэгч, ЭНЭШТ-д зөвлөх эмч\n1992-1996 онд ЭНЭШТ-ийн Ерөнхий захирал, МДИ-ийн эх барих эмэгтэйчүүд судлалын тэнхимийн эрхлэгч, зөвлөх эмч\n1996-2000 онд Анагаах Ухааны Их Сургуулийн Эх барих эмэгтэйчүүд судлалын тэнхимд тэргүүлэх багш, КНАГ-т зөвлөх эмч\n2000-2004 онд Эрүүл Мэндийн Яаманд Бодлогын хэрэгжилтийг зохицуулах газрын дарга\n2005-2011 онд Эх Нялхсын Эрдэм Шинжилгээний төвийн Ерөнхий захирал\n2011-2013 ЭХЭМҮТ-ийн эрдэм шинжилгээний тэргүүлэх ажилтан\n2013оны 9-р сарын 01-хүртэл ЭМШУИС-ийн Эх барих эмэгтэйчүүд судлалын тэнхимийн эрхлэгч, багш, Нийслэлийн Өргөө Амаржих газрын ерөнхий зөвлөх эмч. \n2017 оноос АШУҮИС-ийн эх барих эмэгтэйчүүд судлалын тэнхимд багш, Нийслэлийн Өргөө Амаржих газрын ерөнхий зөвлөх эмч.\n\n1988-1990 онд ЗХУ-ын Белоруссийн Минск хотын Эмч нарын мэргэжил дээшлүүлэх институтын аспирантурт суралцан, тусгай зөвлөлд “Комплексное лечение рвоты беременных с включением луча лазера” сэдвээр Анагаах ухааны докторын (Ph.D) зэрэг хамгаалсан. \n2004 онд Казакстан улсын Алмата хотын ЭНЭШТ–ийн эрдмийн тусгай зөвлөлд “Особенности течения беременности и родов у женщин в зависимости от антропометрических показателей и климато-географических зон Монголии ” сэдвээр Анагаахын Шинжлэх Ухааны докторын ( Sc.D) зэрэг хамгаалсан. \n1996 онд дэд профессор\n2004 онд профессор цол тус тус хүртсэн. \n2009 онд Монголын Анагаах ухааны академийн гишүүн, академич\nОХУ, АНУ, Хятад, Солонгос, Малайз, Казакстан, Белорусс, Литва, Япон, Украйн, Итали, Сингапур, Австрали, Шри-Ланки, Вьетнам, Унгар, Тайвань, Тайланд, Филиппин ,Индонез, Франц, Мянмар ,Молдави ,Узбекстан ,Киргистан зэрэг орнуудад эх барих эмэгтэйчүүдийн эмчийн ба эрүүл мэндийн менежментийн урт ба богино хугацааны сургалтанд хамрагдсан\n',1,NULL,'2020-10-27 00:03:12','2020-10-30 23:37:25',NULL,229,'МУ-ын Хүний гавьяат эмч, Академич, АШУ-ны доктор, профессор ',NULL,NULL),(276,'А.Мөнхбаатар','БОЛОВСРОЛ:  \n2000 он АУИС эх барих эмэгтэйчүүдийн хэт авиа оношилгооны курс\n2001 он   Эх барих эмэгтэйчүүдийн резидентур\n2005 он   Эх барих эмэгтэйчүүдийн ахлах зэрэг\n2009 он   Дүрс оношилгооны резидентур\n2010 он   БНСУ, Чейл эмнэлэгт мэргэжил дээшлүүлэх хэт авиан оношилгооны сургалт\n2014 он   Клиникийн профессор\n2016 он   Анагаах Ухааны магистр\n2018 он   АШУҮИС АУ-ны докторант\n\nГИШҮҮНЧЛЭЛ:\n2005 он AOCOG гишүүн\n2006 он   WFUMB гишүүн\n2010 он Монголын Радиологийн Нийгэмлэгийн гишүүн\n2016 он Испани улс, Дэлхийн Эх Ургийн АУ-ны Холбооны гишүүн\n2016 он  МЭЭЭНН Холбооны Хяналтын Зөвлөлийн гишүүн\n\nШАГНАЛ УРАМШУУЛАЛ :\n\n2005 он     Нийслэлийн шилдэг залуу “Алтан медаль”\n2011 он     Ардын хувьсгалын 90 жилийн ойн медаль\n2012 он     ЭМЯ-ны жуух бичиг\n2012 он      Монголын Эх Барих Эмэгтэйчүүдийн нийгэмлэгийн хүндэт  өргөмжлөл\n2014 он     “Эрүүлийг хамгаалахын тэргүүний ажилтан” цол тэмдэг\n2017 он     Монголын хувийн хэвшлийн ЭМ-ийн байгууллагын Нэгдсэн   Холбооны “Шилдэг эмч” цол өргөмжлөл\n2017 он    “ Алтан гадас” одон\n',1,NULL,'2020-10-30 21:40:44','2020-10-30 23:37:34',NULL,229,'“Тод дэлгэц мед” эмнэлгийн захирал, ерөнхий эмч, Эх барих-эмэгтэйчүүд, Дүрс оношилгооны  эмч, клиникийн профессор',NULL,NULL),(277,'Samantha LEONARD','Dr Samantha Leonard is the International Medical Director of Natera Inc. She has a unique background in clinical genetics and medical ethics, and has practiced in both the UK and France. Her work on pan-European research projects in the area of translational genetic medicine made her well-positioned to meet the challenges of working at the forefront of clinical genetic testing technologies. Dr Leonard has a wide experience of teaching, presenting and publishing in the field of clinical genetics and next-generation sequencing. ',1,NULL,'2020-10-30 21:44:43','2020-10-30 23:37:29',NULL,229,'BSc (Hons) MBBS MA PhD MRCPCH',NULL,NULL),(278,'Г.Мэндсайхан','Боловсрол:\n1968-1978 Улаанбаатар хотын 10 жилийн 3-р дунд сургууль\n1978-1984 Анагаах ухааны дээд сургуулийн эмчилгээний анги\n1990-онд Анагаах ухааны дээд сургуулийн  эмч нарийн мэргэжил дээшлүүлэх факультетэд “Эх барих эмэгтэйчүүдийн эмч”\n1999-онд АУДэС-ийн төгсөлтийн дараах сургалт “Хэт авиан оношлогооны эмч”\n1994-онд АУ-ны магистрын зэрэг “ Чанд авиан шинжилгээгээр жирэмснийг эрт ба хожуу хугацаанд шинжлэх ба зарим норм хэмжээг тогтоох асуудалд”  \n2011 онд АУ-ны докторын зэрэг “ Эрүүл жирэмсэн эхчүүдийн ихэс-ургийн тогтолцооны хэт авиан шинжилгээний хэвийн үзүүлэлт”\n2013 онд ЭМШУИС-ийн дэд профессор\n',1,NULL,'2020-10-30 21:45:28','2020-10-30 21:45:28',NULL,229,'АШУҮИС АУС-ийн Эх барих эмэгтэйчүүд судлалын тэнхимийн ахлах багш Монголын эх барих эмэгтэйчүүдийн хэт авиан оношилгооны үндэсний нийгэмлэгийн тэргүүн',NULL,NULL),(279,'Д.Мөнхцэцэг','Боловсрол:\n1980-1986 онд АУДэС-ийг хүний их эмч мэргэжлээр төгссөн. \n1989 Эх барих эмэгтэйчүүдийн эмч\n1986-1990 Нийслэлийн Өргөө амаржих газар эх барих, эмэгтэйчүүдийн эмчээр ажилласан.\n1990 оноос одоог хүртэл АШУҮИС-ийн ЭБЭСТ-ийн багш\n1997 онд АУ-ны магистрын зэрэг хамгаалсан. \n2011 АУ-ны докторын зэрэг хамгаалсан.\n1999 онд хэт авиан оношилгоо \nОХУ, Хятад, Казакста, Австри зэрэг улсуудад мэргэжил дээшлүүлсэн.\n2013 онд зөвлөх зэрэг \n2020 онд дэд профессор\n',1,NULL,'2020-10-30 21:46:12','2020-10-30 21:46:12',NULL,229,'Монголын эх барих эмэгтэйчүүдийн хэт авиан оношилгооны үндэсний нийгэмлэгийн удирдах зөвлөлийн гишүүн, АШУҮИС-ийн ЭБЭСТ-ийн эрхлэгч, ахлах багш АУ-ны доктор, дэд профессор Д.Мөнхцэцэг.',NULL,NULL),(280,'Ш.Алтантуяа','Боловсрол:\n2007 онд ЭМШУИС-ийн Мэргэжил дээшлүүлэх Институтыг Эх барих эмэгтэйчүүдийн эмч\n2013 онд “Эрүүл жирэмсэн эхчүүдийн ургийн хүйн ба тархины дунд артерийн Допплер шинжилгээний хэвийн үзүүлэлтийг тогтоосон судалгаа” АУ-ны МАГИСТР\n2018 онд “Жирэмсний эхний хугацаанд ургийн зүрхний том гажгийг илрүүлсэн судалгаа” АУ-ны ДОКТОР\n2017 онд Эх барих эмэгтэйчүүдийн АХЛАХ зэрэг\n2013 онд Щвейцарийн Сант Галлен хотод “УРГИЙН ЗҮРХНИЙ ХЭТ АВИАН ОНОШИЛГОО” мэргэжил дээшлүүлсэн.\n2007-2009 онд ХБНГУ-ын ШАРИТЕ их сургуулийн ВИВАНТЕС клиникт Эх барих эмэгтэйчүүдийн мэргэжил дээшлүүлсэн\n',0,NULL,'2020-10-30 21:47:05','2020-10-30 23:37:41',NULL,229,'АШУҮИС АУС-ийн Эх барих эмэгтэйчүүд судлалын тэнхимийн багш Монголын эх барих эмэгтэйчүүдийн хэт авиан оношилгооны үндэсний нийгэмлэгийн гүйцэтгэх захирал',NULL,NULL),(281,'О.Баянжаргал','Боловсрол:\n1994 онд АУДэС-ийг хүний их эмч мэргэжлээр төгссөн. \n1995-1996 онд Улаанбаатар хотноо ЭМШУИС-д суралцан эх барих эмэгтэйчүүдийн,  \n1997-1998 онд хэт авиан оношилгооны эмчийн, \n2005-2007 онд Австрали улсын Сидней хотын Нью Саут Уэльс их сургуульд эх ургийн анагаахын эмчийн мэргэжлээр тус тус нарийсган суралцаж төгссөн. Ажиллах хугацаандаа 2004 онд “ЭМШУИС-ийн АУС-д  Эх барих эмэгтэйчүүд судлалын чиглэлээр “Манас таталт үүсэх эрсдэлтэй жирэмсэн эмэгтэйчүүдийн өөх тосны солилцоонд сармисны үзүүлэх нөлөө” сэдвээр АУ-ны магистрын зэрэг, 2018 онд “Монгол эмэгтэйчүүдийн жирэмсний эрт үеийн ургийн биометри” сэдвээр АУ-ны докторын зэрэг хамгаалсан.  \n2018 онд эх барих, эмэгтэйчүүдийн эмчийн зөвлөх зэрэг хамгаалсан.\n',0,NULL,'2020-10-30 21:47:58','2020-10-30 23:29:00',NULL,229,'Монголын эх барих эмэгтэйчүүдийн хэт авиан оношилгооны үндэсний нийгэмлэгийн удирдах зөвлөлийн гишүүн',NULL,NULL);
